INSERT INTO `blog_posts` (`id`, `title`, `post`, `author_id`, `date_posted`) VALUES
(0, 'If you gave me the keys to your diary, I''d probably read it.', '<p>I''ve had many conversations concerning blogging lately. Much of it centered around our friends who have blogs and what they write about. Gradually, the discussion started where my wife and I kept talking about whether or not we wanted to start our own blogs. For one reason or another, I''ve never been sure if blogging could (or will) be my cup of tea. My first defense has always been that I have nothing to say in terms of pontificating on the "blogosphere." Admittedly, I couldn''t think of anything nice to say, either. (Didn''t Thumper''s father in the Bambi movie have something to say about those who couldn''t say anything nice?) Now I''m also a person with opinions that cause tunnel vision. For a blogger, I have crafted a stereotype where this person has eloquent and witty sayings, always well-received by their followers - a category that I would not fit into. Furthermore, I imagine that bloggers would be susceptible to an addiction where they shed their love for the activities in the real world and become consumed with their online dissertations. I can guarantee that I won''t be faithful to this blog.</p>\r\n\r\n<p>Over time, my attitude toward blogging has changed. To be accurate, it is in a state of change. When I think about how people record their lives, I quickly realize that those who care to preserve the past have always employed various mediums for accomplishing that purpose. Of course, an oral tradition has always existed in some fashion, whereby the old tell their stories to the young, hoping that they in turn will keep a story alive. Additionally, people have, for thousands of years, kept written records of their lives and of history. Taking this in stride, I think that my approach to blogging now has now been reconditioned. A blog, is of course short for "web-log" -Simply a journal/record of sorts. Since I now find myself at an age where my childhood memories are blurring, I have a renewed desire to record my life - be it in stories, thought, or opinion.</p>\r\n\r\n<p>My grandfather flew B-17 bombers in the second world war. He was one of the millions who signed up willingly to fight, wanting to serve his country and realizing that a draft was just around the corner. Luckily, he was wise and took it upon himself to write down his story about 15 years ago. I''ll never forget when I opened that book and pored over the pages and pictures he''d included. In this rare opportunity, I had a chance to look through a "worded window" into my grandfather''s life - a life that had started so many years before mine. As I read his account, I was also intrigued by the many journal entries he included therein and the sense of privilege felt while reading it. One day, he will no longer be here to tell that story and I''m thankful that he preserved his story in writing.</p>\r\n\r\n<p>It''s important to realize that blogging is tantamount to the journalizing that my grandfather did in the past.  It is purely circumstantial that I can type faster than I can wield a pen. I also believe in taking advantage of our present day technology and contribution to the information age. Thus, I start this account as a journal of what I deem important or noteworthy, lest I forget in the future. If you''ve ever read/seen Harry Potter, you''ll remember that Dumbledore''s head was so full of memories that he sought to preserve them in vials. I don''t have a wand to extract thoughts.... consequently, I store my "vials" on this page. I hope you might find it occasionally interesting as well.</p>\r\n', 1, '2010-01-11'),
(1, 'I shook the hand of John Wayne', '<p>If you travel enough, you''ll see things that you never want to forget. I''m based in Houston, TX with my airline so I commute in and out of Birmingham about once a week. Most of the time, I wear my uniform since I''ll be flying later on that day.</p>\r\n\r\n<p>One evening last year, I was commuting home from Houston and was walking to the gate to get my jumpseat form. As I approached the gate agent, an elderly woman standing nearby took me aside and asked, "Are you our pilot?" Since I was only riding home, I responded to her, "No ma''am, I''m not the pilot for this flight," hoping that she would leave me alone. However, she persisted with her question, "But you are a pilot, though, right?" I responded affirmatively since I was in uniform. Apparently, this woman had something to say to me! She then took my hand in hers and began shaking it. This wasn''t the brief, cordial handshake that two people exchange upon greeting one another. This was what I might classify as the "extended handshake." She stared at me for a few moments and continued shaking and finally began to speak. -Knowing that it would be rude to withdraw my hand, especially from someone who is a customer of our airline and older than me, I endured the shake, hoping it would wouldn''t be much longer before she was done. I was wrong.</p>\r\n\r\n<p>"I want to tell you something, young man. This hand right here is the hand that shook the hand of John Wayne when he was filming Sands of Iwo Jima in 1949. This is also the hand that shook the paw of Lassie in 1954!" Feigning interest, I commented, "That''s wonderful, what an opportunity you had!" She finished her story with: "I shake the hand of every pilot who flies me and I haven''t washed my hand since!" At this she finally withdrew her hand and her "shake &amp; story " was over. While I would normally laugh about her hygienic negligence, I remember feeling and seeing a wart on the palm of her hand. </p>\r\n\r\n<p>Is there a lesson I have learned from this? Possibly: Sometimes the act of being good-natured must be followed with a thorough scrubbing of the hands. Remember that next time you shake my hand, you are shaking the hand that shook the hand of John Wayne. - and Lassie. </p>', 1, '2010-01-11'),
(2, 'Concerning a bean-derived beverage', '<p>Thanks to spousal encouragement, I am subjugating myself to writing this evening. I thought it only fair that I give adequate attention to the topic of coffee, a well-loved beverage of mine. I will probably write frequently about coffee since I now identify myself under the moniker of "coffee connoisseur."</p>\r\n\r\n<p>I can still recall the exact moment in time that my taste buds realigned themselves during my youth to accommodate the flavor of coffee. As a child and up to my middle teenage years, I had always been disappointed with this drink. When I would smell coffee beans/grounds, I imagined a completely wonderful drink, "perfect in every way" (-Marry Poppins) However, tasting the brewed drink was a bitter, acidic experience; my senses reeling from the deceitful smell. In order to be potable, coffee would take an incessant amount of taste tweaking by means of adding sugar and milk, something I viewed as an exercise in futility and further increasing the unpredictability of how the coffee would taste. Clearly, I was attempting to make cheaply brewed coffee GOOD.</p>\r\n\r\n<p>These experiences conditioned my mind to view coffee as a "grown-up" drink, something sipped during Sunday School and social events. Coffee wakes the mind and mars the breath - nothing more.</p>\r\n\r\n<p>Of course, when you grow up, you change. I remember one evening, my mother brewed coffee to accompany the chocolate-chip cookies that she had just baked. Cookie baking had become a sort of ritual at the house due to the advent of bulk cookie dough being sold at Sam''s Club and local grocers. It had become as easy as slicing up some Jimmy Dean sausages and throwing them in the pan. Pilsbury &amp; Co applied the "sausage roll" principle to their dough packaging and VOILA! - cookies every night. On this particular night, I riskily chanced trying a cup of coffee to go with the sweet dessert. I must say, I was in for a surprise because my brain forged a new neural path as I took that first sip of black, un-doctored coffee after the bite of cookie. The slightly bitter, roasty taste of the coffee complimented and offset the sweetness of the cookie!</p>\r\n\r\n<p>I was hooked. I realized that if the coffee I drank was of decent quality, the smoothness in taste increased and the unwanted, bad tastes were no longer present. Also, in league with my burgeoning love for coffee, some good friends presented me with some coffee from Brazil, a souvenir of a recent mission trip. I''ll never forget the consequence of my ignorance as I brewed the highly-caffeinated coffee during the evening hours and found great difficulty in falling asleep. During all of this time, I changed my modus operandi to consumption of black, unadulterated coffee. I began to appreciate the taste of the brewed beverage by itself.</p>\r\n\r\n<p>For those of you who know the jobs I have held, you might remember that I was employed at Starbucks Coffee Company during 2003 - 2004. Although my time there was short, I was introduced to and became familiar with several methods of brewing coffee. In subsequent posts, I will detail these methods in an attempt to document my own coffee experiences and to additionally provide supplemental knowledge to those who are aspiring coffee-lovers.</p>\r\n', 1, '2010-01-22'),
(3, 'In Defense of Big Words', '<p>I believe that this topic has been on the forefront of my mind even before I considered starting a blog. In the United States, we have adopted a practice of using a limited vocabulary by virtue of employing communicative ignorance. How do I know this? Obviously, if you have read any literature from by-gone years, you have encountered a layer of textual poignancy that has escaped us in this present day.</p>\r\n\r\n<p>Why does my head hurt after picking up an unabridged Mark Twain classic? Is it embarrassing that Dickens is considered "too heavy" for most people? Shouldn''t the language style utilized by these authors be considered understandable without laboring over semantics at the monthly book club gathering?</p>\r\n\r\n<p>In the past, I have been intimidated by words of great stature. From my upbringing in the southern region of the United States, I encountered many practices of simple vocabulary, including use of slang emanating south of the Mason-Dixon Line. In the milieu of my personal and professional life, I have discovered that people are largely uninterested in the expansion of their vocabulary. I could safely say that the use of big words is looked down upon by most because it is seen as a means of superficially elevating oneself by "talking FANCY."</p>\r\n\r\n<p>Let me tell you, I have acquiesced many times to the limited vernacular of the south, whereupon I have further stunted my communicative skills. Why do I fall prey to this tendency? Is it an underlying desire to be accepted by using speech that I know will relate easily to others?</p>\r\n\r\n<p>I am fortunate to have examples in my life who welcome the use of new words. Namely, my brother-in-law and another individual who works at my airline positively demonstrate their pursuit of new words.</p>\r\n\r\n<p>Over time, I have realized one important truth: An individual with an adequately developed vocabulary possesses the ability to more accurately communicate what they intend.</p>\r\n\r\n<p>Please realize that if I use a word that is uncommonly used, it''s not in an attempt to impress you. It is purely a reflection of my effort to more clearly communicate what I have to say.</p>', 1, '2010-01-23'),
(4, 'Wanted: Your Contribution to the Information Age', '<p>We are living in the middle of the Information Age. If you have ever thought about the future content of schoolroom textbooks, you may have speculated as to what they will contain. While they will read about the Ice Age to the Machine Age, Atomic Age and Space Age, students will also read about the Information Age. This age is defined by the idea that people now have the ability to freely access &amp; transfer information from anywhere, especially where it wasn''t previously available. More importantly, the focus is on the flow of information conducted through the internet. Unbeknownst to many, we, as members of modern society are already participating in what history will be like - that is, the history of our current "Age." Allow me to describe:</p>\r\n\r\n<p>How many of us already turn to a Google search whenever we have a question regarding a relatively obscure topic? I know some of my obscure searches included: ''butter-less cookie recipe,'' ''where to watch apple media event,'' ''is Johnny Depp dead?'' As you can see, I rely on the access of online information to answer questions in lieu of referencing the newspaper, calling a friend, or watching the news. In the past, people relied on a very limited set of venues for information retrieval. In the United States, we could easily list the use of informational resources in chronological order: newspaper, mail, telegraph, telephone, radio, t.v., and internet. It is extremely important to realize that the aforementioned methods of disseminating information to the masses were limited to the few who had control over them. Said another way, unless you owned the newspaper company, television network, or radio station, you had no ability to control content. This control has subsequently caused several undesirable effects. The array of presently available media offerings are viewed as a belligerent monster, gilded with mediocre factuality, bias, and political correctness.</p>\r\n\r\n<p>Gradually, a change has occurred in response to the monopolistic handling of the mainstream media. Proliferation of internet use has resulted in individuals gaining content control as well as the ability to contribute information. One unique manifestation of this is through online collaboration, discussion, and debate. A blog is one such example. Since 2002, Technorati.com has indexed 133 million blogs with an average of 900 thousand posts daily. What an excellent portrayal of individuals controlling their own content through contribution! It''s interesting to note that if you looked at my family alone, 6 of us have started blogs within the past 3 years and 4 blogs within the past 2 weeks. Our familial blog topics include: raising babies, life in Chicago, cooking, music, and travel, etc. This online platform allows writers, like me, to become the architects of their own content flow and provides a means of publishing whatever I deem appropriate.</p>\r\n\r\n<p>Realize that if your content is made publicly available, others can access it and possibly add your blog to the cadre of informational resources consulted on a daily basis. A personal example of this: My wife and I are using a method for helping our baby son to sleep through the night at a young age. This book is called "Babywise." Although the book very clearly explains the methods and practice of helping your baby sleep through the night, we wondered about other parents who had already used this method and what their experience was. Luckily, my wife discovered a blog called "Chronicles of a Babywise Mom."  Jackpot! This mother''s blog has been an invaluable resource for referencing a real-world use of the Babywise method. As a result, we have been able to gain answers to many questions and insights that otherwise wouldn''t have been found among our circle of friends who don''t have any experience with Babywise.</p>\r\n\r\n<p>As a hobby, I have taken an interest in computer programming. First, understand that I am an unashamed, unapologetic nerd/geek when it comes to learning about tech. As a result of my continual desire to learn how things work, I became severely obsessed with learning how to program for a computer shortly after purchasing my first Mac computer. When I decided I wanted to learn how to program, I was enthralled by the immense number of tutorials freely available online, all relating to programming. Although my references for learning included two textbooks on programming, I have found many examples and tutorials that were published not by a software company or hardware company, but by developers who take an interest in teaching others how to program on their personal blogs. Although this may be seen as controversial, a self-taught, aspiring programmer can be just as sharp as the student holding a computer science degree. The information is there... if you look for it.</p>\r\n\r\n<p>Inimitability, by definition, means that something is incapable of being copied or imitated. Each person''s unique insights, comments, etc are vital for augmenting the robustness of the Information Age. I suggest that if you have something to say, stand on your soapbox.... and get going.</p>', 1, '2010-01-26'),
(5, 'The Wave of Movie Rental Future', '<p>Leonardo DiCaprio portrayed Howard Hughes in the film, "The Aviator" in 2004. In the film, Howard got stuck repeating certain phrases as part of his severely eccentric nature. I still joke with my wife about his continual chanting of "It''s the wave of the future, -it''s the wave of the future, -its the wave of the future, -it''s the wave of the future." Howard was chanting about the the future of aviation with the introduction of the commercial Seaplane airliner. Today, I am chanting about the future of movie rentals.</p>\r\n\r\n<p>Growing up, we went to "Video Gold" to rent our movies. This was one of only two movie rental stores in Humboldt, Tn. (population - 8,500). With each rental, you were permitted to remove a key hanging on a nail underneath the movie that you were renting in hopes of unlocking a box of cash on the counter. Naturally, the key I took NEVER opened the box of cash. I would ask my parents if we could rent a movie at Video Gold just so we could have another attempt at liberating the boxed cash. -What a gimmick!</p>\r\n\r\n<p>Today, I think that other gimmicks still persist when it comes to renting movies. The gimmick in existence now is: the rental store. That''s right, I don''t believe that you need a physical store to rent a movie any more. When you rent a movie, you shouldn''t pay exorbitant rental fees in order to fund the excessive operating overhead that places like Blockbuster &amp; Movie Gallery incur.</p>\r\n\r\n<p>The reason is simple: media can be accessed from a broad spectrum of devices; internet, cable, etc. After all, it''s only data, -data that could be transferred through any of those mediums. Unfortunately, movie production companies severely limit the end customer in terms of accessing movies. In other words, if I''m not willing to go to the theater or be limited by pay-per-view choices, I have only a couple of options for film-watching. My principles dictate that I won''t shell out for a ticket at the theater unless I know it''s going to be a flick I shouldn''t miss. The result: I''m bound to renting movies frequently. I believe that movie renting should be easy - I should be able access it from the comfort of my home through an access medium of my choosing and pay a straightforward price. Too bad! It''s not that easy. I''m required to venture out and go to a physical store to access media! Obviously, this is not a problem concerning my trips to get milk or bread. I realize that there isn''t a magical "beam-me-up" machine that transports groceries to my home. (-Frankly, I''m happy such a machine doesn''t exist, otherwise people would transport themselves that way and the world wouldn''t need pilots anymore.)</p>\r\n\r\n<p>Tragically, there has been a disproportionate increase in rental costs @ places like Blockbuster in recent years. During my college years (2000 - 2004), a new-release rental cost 2.99 and other movies cost 1.99. Presently, new release movies are running upwards of 6.00. What has caused a 100% increase in rental costs? Luckily, things are beginning to move in the right direction.</p>\r\n\r\n<p>Notably, the creation of three entities: NetFlix, RedBox, &amp; iTunes Movies are causing a paradigm shift on how we access movies. Here is a brief overview on how they are changing the rental industry:<p>\r\n<ol>\r\n\r\n<li>NetFlix allows you to rent movies for as long as you want for a set price. No late fees, and No going to the store. You simply create a queue of movies that you want to watch and they arrive in your mailbox.</li>\r\n\r\n<li> Redbox has also established an easy, flat fare way to rent movies. While you still have to leave the house, you can locate a nearby Redbox kiosk (found @ gas stations, walgreen''s, wal mart, etc.) and select a movie for $1 a night, even it''s a new release.</li>\r\n\r\n<li> Apple''s iTunes Movies is forging new paths by offering 24 hr rentals for a set fee of 3.99 or 2.99 for new releases and older movies, respectively. iTunes will allow you to play a movie on your laptop or directly to your TV if you have Apple TV firmware. My hat is off to them for setting realistic and straightforward pricing. </li>\r\n</ol>\r\n\r\n<p>You can easily see the pros of each of these, however what are the cons? While NetFlix allows you to access an extensive selection of movies, it takes time and planning before the movie is in your hand and there is an absence of spontaneity with movie selection. Redbox allows spontaneity for a good price, but the selection is limited to a choice few. Ultimately, iTunes Movies would be the best choice provided that they continue to digitize movie content and increase their selection. Imagine being able to watch any movie made in the past 80 years with the touch of a button!</p>\r\n\r\n<p>I recommend that you consider your options next time you are planning on watching a movie. If you go to Blockbuster or the like, expect to pay 6.00 to walk in a store to rent a movie that they know will probably result in possible late fees or aptly-named "re-shelving fees" You might as well buy a ticket on RyanAir (a low-fare European airline) and be slapped with a 2 - 3 Euro charge for any thing extra, including getting a drink of water or using the lavatory. Otherwise, ride the wave of the future.</p>', 1, '2010-01-30'),
(6, 'The Ghost of Forgetful Past', '<p>I relish taking part in family gatherings.  It''s especially enjoyable now because I am now a member of two extended families, so to speak.  Don''t get caught up with semantics, I only mean that I''m a part of my family and a part of my wife''s family as well.   Since we live a fair distance from extended family, our gatherings are relatively infrequent.</p>\r\n\r\n<p>As I detailed in my first post on this blog, the oral tradition is still in existence, and it is very much alive in our families.  In the midst of a family gathering,  we will invariably encounter a copious amount of reminiscing.  Family members all become storytellers in their own rite at least once a year,  springing from a love of sharing experiences already past.  When this happens, you can always count on the following occurrences between the two parties, that is, the teller, and the listener(s).</p>\r\n\r\n<ol>\r\n<li> The teller will say something that the listener doesn''t remember, even if that listener was a part of the story.</li>\r\n<li> A listener will almost always add something to the story or dispute the account being given.</li>\r\n<li>If a teller agrees or consents to an argument presented against the story, the teller thus alters their perspective on the story told.</li>\r\n</ol>\r\n\r\n<p>Our family gatherings, in effect, can spawn collaborative feedback which will subsequently enrich the existing oral tradition.   Although this assessment may appear to be scientific in nature, it has merit when you consider the intent of this blog.  Since my first post on January 11, 2010, I have been afforded several opportunities for introspection and self-analysis, especially when I learned yesterday that my own stories may be unique to me and me alone.   In a conversation with my mother, I was told that my post about unlocking a box of cash at the rental store was something that not only did she not remember, but my brother, sister, and father didn''t remember either.   I then told her that I only remembered the story because I was blogging about how I dislike renting movies at Blockbuster.  It occurred to me that had I not been writing about movies, I may have never recalled my story.   You might be saying, "Well, Matthew, I really couldn''t care less about your failure to unlock a box of cash 20 years ago!" I don''t blame you.  However,  blogging teaches the lesson that your story telling, be it the story you tell at a family gathering or online is a catalyst for recalling life experiences, regardless of their substance.  I acknowledge that this is a somewhat comical revelation for an individual such as myself who engaged in active naysaying on the topic of blogging.  Indeed, "The persecutor of the pen is now holding the pen."  (Yes, I just made that saying up.) </p>\r\n\r\n<p>Take another look at the oral tradition within the context of one generation: you will discover that the oral tradition is unique to each generation.  The composition of our family today will be different in the future.  Consequently, the stories will be different as well.  What happens to the stories that are around today?  Will we rely on archival knowledge to pass on the really good stories?  Consider the details of your personal history as sand in an hourglass.  If each detail was a grain of sand, you would experience a loss in detail over time.    If you understand this point, you understand why blogging is a valid approach to counter the eventual fuzziness of the human brain.   Still under the impression that different perspectives aren''t important?  Remember, even the Bible has four gospel accounts detailing the life and ministry of Christ.</p>\r\n\r\n<p>I still consider myself to be in the infantile stages of building this blog.  Therefore, I desire a framework of concepts to be promulgated in the opening posts that corroborate why I am writing.  Additionally, this serves as a springboard concept to perpetuate further lessons on preserving my history.  I can only hope that this momentum increases from here.</p>', 1, '2010-02-03'),
(7, 'How would you like your coffee?', '<p>Ever had coffee on an airplane?  It isn''t that great.  It comes from a miniscule galley with a coffee pot that is used all day long and probably only rinsed with water.  The burner is on for hours at a time, facilitating the build up of a hard, black crust in the bottom of that pot.  The coffee marinates on top of that crust and yields a rancid, bitter brew that might even cause the die-hard caffeine junky might turn up their nose.   The best part is when the stale coffee aroma is circulated through the airplane''s air distribution system and is delivered to the collective olfactory sense of everyone on board.  ahhh - the quintessential airline experience.</p>\r\n\r\n<p>In an effort to mask the unpleasantries of "cafe aloft,"  flight crews have adopted several practices to make the drink better.  Flight attendants will often rinse the pot two or three times extra prior to brewing, or make the coffee double strength.   Sometimes, we even brew the coffee with cinnamon or sugar mixed into the grounds.   During a typical flight, once the flight attendant finishes a service in the back, they will normally call up front and ask us if we want anything to drink.   This is a courtesy to the flight crew and allows us the opportunity to procure some refreshment, a welcome amenity on a longer flight.    I would imagine that there is some unwritten rule dictating that if you want something to drink, your order should be simple and uncomplicated.   Some pilots have their own way of doing things, however..\r\nHere''s a sampling of orders I''ve heard: </p>\r\n\r\n<p>"I''ll have a cranberry juice with a lime and a bottle of water."</p>\r\n<p>"I''ll have a soda water with a lemon and a lime."</p>\r\n<p>"I''ll have hot tea with two sugars."</p>\r\n\r\n<p>Doesn''t sound too bad, right? This could be construed as picky, but not impossible.  The most egregious offenses are observed when it comes to ordering coffee.</p>\r\n\r\n<p>"I''ll have half a cup of coffee and a carton of milk and a sugar."</p>\r\n<p>"I"ll have coffee, black, with 2 sugars, not mixed.</p>\r\n<p>"Coffee, with half a sugar, a splash of milk, not stirred."</p>\r\n<p>-You might think that you were at Starbucks listening to orders fly...</p>\r\n\r\n<p>While most airliners around these days require two crewmembers, there are still a few planes that require three.  The Boeing 727 is one of these.  The flight crew consists of a Captain, a First Officer (equivalent of co-pilot) and a Flight Engineer or (F.E. for short).  The FE doesn''t actually fly the airplane. Instead, they have a dedicated station in the cockpit for monitoring the aircraft''s engines and various systems.  More often than not, the FE is the most junior crewmember. (jargon for "low man on the totem pole") If you are unaccustomed to flight crew dynamics, the junior person will often perform tasks that aren''t as enjoyable as others.   This includes doing aircraft walk-around inspections (a loathsome job in extreme weather) and completing tedious calculations for aircraft takeoff &amp; landing performance and weight/balance.</p>\r\n\r\n<p>My father in law flies at a freight airline where there are no flight attendants.  They fly 727''s and the FE is responsible for making the coffee.  He recounted a story to me about one particular Captain who was probably among the pickiest when it came to ordering coffee.   Over several flights, the Captain ordered his FE to make him coffee with very specific measurements of sugar and even told the guy how many times to stir it.  The FE eventually got tired of it.   In a subtle move, he selected a grease pencil (a waxen pencil for writing on polished surfaces) and stirred the coffee just as the Captain had asked.  As he stirred, the wax became infused with the coffee.</p>\r\n\r\n<p>Freight airlines operate the majority of their flight schedule in the middle of the night and the Captain couldn''t see the blackish residue remaining on his upper lip as he finished the cup.  I''m sure he didn''t taste anything funny since the coffee was bad enough to begin with. (Grease pencils might even make the coffee taste better).</p>\r\n\r\n<p>I can only imagine the snickers that his junior counterparts stifled and the Captain''s shock upon looking in the mirror at his hotel room that night when he discovered his black "mustache."</p>\r\n\r\n<p>How would you like your coffee?</p>', 1, '2010-02-11'),
(8, 'Caught - by a pyrotechnicality.', '<p>We were sitting around the table this week during dinner and I started yammering about my experiences as a kid with fire.  I''m all about disclosure of the tricks I pulled in my earlier years, so I''ll share it now.</p>\r\n\r\n<p>Let''s face it, most boys are pyromaniacs.  Somehow, an inborn love for creating fire exists within a young boy, akin to the primitive man of yesteryear and the desire to create fire.  I fell prey to this maniacal device and I sought to create and enjoy fire &amp; smoke when I could.  I know smelling smoke isn''t good for you.   I do know, however, that I love the aroma of a campfire or the smell of a charcoal grill.  I even enjoy the smell of cigar  and pipe smoke.  Sorry, there isn''t any way you can convince me that it smells bad just because of the carcinogens.  </p>\r\n\r\n<p>This past week, I had a recollection concerning the possession of my favorite fire-making device... a cigarette lighter.  As a kid, you aren''t permitted to walk into a gas station and plunk down the $2 for a cigarette lighter.  Lucky for me, I found one on the road one day and it was a dream come true.  I hid the lighter behind my dresser.  If my mom found it, she let me keep it, because I would pull it out every couple of weeks or so and look at it.  I adored my cigarette lighter and never showed it to anyone, even my brother.  I was dumb enough to show it to my childhood friend, Josh.  Josh subsequently threatened to reveal my secret treasure if I didn''t do what he asked.  His request, that particular day, was to smoke a bamboo leaf.  On that day, he took a rolled, dried bamboo leaf from an old bamboo stalk I had cut and lit it on fire.  With a menacing stare, he said, "Smoke it!!!"  I put it to my mouth and drew in .. harder than I should have.  Let me remind you that a dry bamboo leaf doesn''t smoke quite like a smoldering cigar.  This leaf was loosely rolled and was literally flaming with black smoke rising from the opposite end of this rude smoke.  My lungs filled with the black, hot-dry smoke and I choked for air, coughing and spitting.  I''m sure I had a pitiful look on my face as my friend looked on, triumphing over my ignorant consent to his whim. </p>\r\n\r\n<p>My father was doing yard work at the same time this was happening.  I''m sure I looked at him and tried to quell my heaving lungs in an effort to hide my pain.   If he saw what happened, he never let on.  Some lessons are better learned quietly.  My father confided in me about his own smoking experience as a kid.  He told me about his smoking that he did in the woods in his younger years and how he confessed to his mother about it.  Her simple reply was, "I know."  Parents know more than you think.    My misstep was a painful lesson about bully friends and the consequences of giving into peer pressure.  </p>', 1, '2010-02-18'),
(9, 'Thank goodness for disclaimers', '<p>At least I covered my back when I said I wouldn''t be faithful to this blog.\r\nI''m just going to write down a list of items that might be possible blog topics.</p>\r\n\r\n<ol>\r\n<li>I''m tackling a huge software project</li>\r\n<li>I''m learning web development (part of my software project)</li>\r\n<li>Had an interesting commute home the other night (almost didn''t make it...)</li>\r\n<li>Perennial Love for the Goldberg Variations.</li>\r\n</ol>\r\n\r\n<p>See you soon!  (hopefully others read this or it appears that I''m talking to myself)</p>', 1, '2010-03-09'),
(10, 'All I Needed to See', '<div class="separator" style="clear: both; text-align: center;">\r\n<a href="http://2.bp.blogspot.com/_Se_Sds8CMXY/S61g6cI9-LI/AAAAAAAAABE/GVSx949ZyiU/s1600/AppAccepted.png" imageanchor="1" style="margin-left: 1em; margin-right: 1em;"><img border="0" height="307" src="http://2.bp.blogspot.com/_Se_Sds8CMXY/S61g6cI9-LI/AAAAAAAAABE/GVSx949ZyiU/s400/AppAccepted.png" width="400" /></a></div>\r\n\r\n24 hours and counting down.....\r\n-This made my day!', 1, '2010-03-26'),
(11, 'Are You an Illegal Alien?', '<p>I remembered this story tonight when I was watching SNL''s latest episode which included a parody of the 2010 Census form.  One question was "es usted ilegal?" (are you illegal?)</p>\r\n\r\n<p>A few months ago,  I was walking down the jetbridge to our airplane for a flight to Mexico.  During normal pre-flight preparations, a flight crew will generally board the airplane 30 minutes prior to the passengers boarding the airplane.    This is typically an uneventful ritual whereby we (as the flight crew) arrive at an empty plane.  I was surprised on this particular day to be met by officers from the Customs and Border Protection Agency.   We exchanged greetings and I went about my normal duties.   I was unsurprised by their presence due to the fact that Customs/Border Patrol (CBP) and TSA Agents regularly conduct additional screenings and checks for international flights.</p>\r\n\r\n<p>Our flight completed boarding and near the end, I noticed that the CBP agents were crowding around a certain individual as he boarded the airplane.  It was a man who appeared to be in his fifties.  Why so much  attention for this man?</p>\r\n\r\n<p>This mexican man had made his way into America by illegal means.  He subsequently tried to apply for a job and made a small error on his application for employment.  For the question, "Are you an illegal alien?"  -He checked, "YES."   - Apparently, such honesty will get you deported.</p>', 1, '2010-04-12'),
(12, 'This Website is Somewhat of a Learning Ground for My Own Benefit', '<p>I''ve been experimenting lately with two technologies that I''m somewhat new with.  CSS, or Cascading Style Sheets is a language used to control the style and layout of an html document. The other technology I''m currently learning is javascript.  Actually, I should be more specific, I''m learning jQuery, a library that makes writing javascript functions easier.  Maybe that''s cheating, but when you are assimilating multiple technologies concurrently, simplicity is paramount. </p>\r\n\r\n<p>For this project, I''m using some javascript to change the style sheet that controls the layout and styling of this page.  Clicking the "switch" button will change the style sheet and the look of this page.  Have a try.</p>\r\n', 1, '2010-07-01'),
(13, 'Blog Migration and Using RSS', '<p>When I first started blogging at the end of last year, I established an account on blogger.com known as "The French-Pressed Life". Blogger.com is Google''s easy-to-use blog site that allows an impressive amount of customization to your blog so that it looks entirely unique.  Now that I''m learning web development, I decided it would be an excellent exercise to develop my own blog and couple the content with my site.  The goal is to have all of my blog posts moved from the "The French-Pressed Life" on this site eventually and implement a CMS (content management system) for viewing them.  Who knows... maybe this site will even be RSS capable in the future.</p>\r\n				<p>Now that I mentioned it... have you heard of RSS? RSS stands for "Really Simple Syndication" or "Rich Site Summary."  Both names essentially define the function of RSS - a simple way of viewing a site so that you can easily scan the content for the information you want.  Take CNN.com for example; you know that visiting CNN.com or any news site for that matter will present you, the end user, with a large list of stories that you have to filter through before finding the article that you want to read.  If you are visiting CNN for the latest update on the Gulf Oil Spill, you might have to scroll down from world news headlines, sub-headlines, etc, before finding that information.  Invariably, you''ll be distracted by another article on Britney Spears'' latest look or an ad for Nike Shoes.  Now where was that Gulf Oil Spill article again? </p>\r\n				<p>If you used the RSS feature however, you''d be viewing the articles only: by headline and summary. You can find the RSS toggle feature on the Safari & Firefox by simply watching for the RSS badge or RSS icon in the address bar. </p>\r\n				<p>Let''s use the Safari browser for example. If you went to an RSS-capable website, you would notice the RSS badge in the right-hand side of the address bar:</p>\r\n				 <img src="RSSBadge.png" alt="RSSBadgeImage"></img>\r\n				 <p>Clicking the badge will cause the site to open the built-in RSS reader that shows only articles with title and description.  This would be true of a blog site where you would see blog entries and their description or opening lines. </p>\r\n				 <p>This method of quick and simple syndication allows you to sift through site content faster without distraction.  If you frequent a certain website for news, blog reading, etc, you can realize a more fastidious approach to consuming pertinent information. </p>\r\n', 1, '2010-07-06'),
(14, 'RSS Solved?', '<p>My previous blog entry discussed adding RSS capability to a website.  After writing about adding this capability I realized I had a strong urge to add RSS capability to my site right away instead of later down the road.  I considered the looming task of migrating my blog from french-presed life and it became apparent that I establish a workflow for migrating each blog entry. Each entry would need to be added not only to the main site but to the .xml document that the RSS reader uses as well.  The primary challenge of making a website RSS-ready was finding the appropriate tutorial to guide me.  The majority of the tutorials were centered around using a software package to convert your site content to an .xml document.  What I really needed was a tutorial that demonstrated how to hand code the capability.</p>\r\n				<p>Granted, some of my efforts are arcane in execution.  I could have used a ready-made application to convert RSS but that would have prevented learning how this particular technology works.  However, I always have fun learning how to "make it work."  Without further introduction, please enjoy RSS. </p>', 1, '2010-07-07'),
(15, 'Lacking a view to the 4 pillars', '<p>As I was doing some research this week, I read an article about the four pillars of web technology: HTML, CSS, JavaScript, and PHP - and I''ve only been utilizing the first three.  As of my last writing, I was dabbling with some JavaScript and enjoying the benefits of adding functionality to a webpage (particularly this one).  I kept running over something that was relatively troubling, though.  JavaScript is entirely <i>client-side,</i> as opposed to <i>server-side.</i> Although JavaScript can change the way elements appear on a website, it is essentially unable dynamically query content from the server.  Given the context of my page, JavaScript is the technology that moves the navigation tabs on this page and toggles the portions of the website that you see currently... but it doesn''t hail the server for that functionality.</p>\r\n				<p>When using HTML, CSS, and JavaScript, I''ve found that you can really create some functional, aesthetically pleasing web-content.  At the same time, I was lacking the ability to create persistent material.</p>\r\n				<p> As an example, consider how a simple site-counter works:  A site counter will register one ''count'' when the user clicks on a link or visits a particular website.  The users browser does not keep record of this value (think: <i>''client-side''</i>).  Instead, the counter registers its value to the server where the website resides.  Each time a visitor views the page, the counter is incremented.  When the page is served to the user, the webpage dynamically displays the current value of the counter. </p>\r\n				<p>How does this counter work?</p>\r\n				<p>First, review the first 3 pillars are for these primary goals:</p>\r\n				<ul>\r\n					<li>HTML: page structure and core content</li>\r\n					<li>CSS: HTML element and content styling</li>\r\n					<li>JavaScript: client/user-side scripting for page functionality</li>\r\n				</ul>\r\n				<p>This is where the fourth pillar: PHP, comes on stage.  PHP is a server-side scripting language for dynamically producing web content and for communicating with a database for data-driven websites. PHP is a recursive acronym for: <b>P.</b>H. P.: <b>H</b>ypertext <b>P</b>reprocessor.</p>		\r\n				<p>The aforementioned site counter works by utilizing a PHP script that resides on a server, such as were the website lives as well. As before, when the user visits the site, a PHP script embedded in the html document fires off a function that increments a value stored in a file or database. That value is incremented and the current value is queried and displayed to the user. </p>\r\n				<p>I have just given rude and insultingly simple introduction to a very powerful technology. PHP can add a great deal of flexibility and power to your site.  For this site, I have decided to back the blog in a MySQL database.  PHP works hand in hand with databases, and I want each blog post to be persisted to the database and dynamically served when this page is loaded instead of embedding each post directly in my main page.  On the reader side, you shouldn''t see many changes.  I intend for this blog to be readable and easy to access.  At the same time, this site will most likely command use of an architecture commensurate with its planned size. I have learned from previous experience that your programming/developing endeavors should reflect organization from the beginning - lest the developer witness his/her work bloat into an un-maintainable  mass of data and code. </p>\r\n				<p>When i discussed blog migration a few posts earlier, I was attempting to sketch out a workflow for moving each post.  As I pondered my plan, I determined that moving every post would be a nightmare if I had to add them directly to this document.  As such, PHP is the answer for dynamically serving up each blog post from a database... PHP is the fourth pillar, and hopefully the last technology to learn in my effort to understand web development. </p>\r\n', 1, '2010-07-14'),
(16, 'Database-backed blog', '<p>If you saw my 15th post, I ran a database query that showed all blog entry titles.  As of now, all posts that you see are coming from the database!  I know blogger.com and other sites use databases to back a user-submitted blog entry and I''m pleased to tell you that I have successfully done the same.</p>\r\n\r\n<p>All posts are dynamically generated to this page using a PHP script that queries the database. As a result, you will see the five most recent blog posts when you access the blog tab on this site.</p>\r\n\r\n<p>Currently, I have spent several posts detailing a prolific amount of technical detail.  If you''ve been uninterested, I apologize.  I know that my efforts to synthesize these technologies is somewhat dry.  I only write these entries to document my progress to build this site and all of its attributes <i>ab initio</i>.</p>\r\n', 1, '2010-07-17');
