(46, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b'),
(46, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'Ground power is available to supply power to the electrical system.', 'The aircraft electrical system is powered.', 'The ground air supply is supplying bleed air to the packs.', 'All of the above.', 'a'),
(46, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'All electrical busses except the shed busses.', 'DC bus 1 and DC bus 2', 'The hot battery busses, essential busses, and the central DC bus.', 'The entire electrical system.', 'c'),
