(90, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Both packs stay on.', 'Pack 2 turns off.', 'Pack 1 turns off.', 'a'),
(90, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Pack 1 is on, 2 is off.', 'Pack 2 is on, 1 is off.', 'Both packs are on.', 'Both packs are off.', 'b'),
