(90, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'As soon as the electrical system is powered.', 'By a 5G impact or immersion in water.', 'By turning on the navigation lights.', 'By turning on the red beacon.', 'a'),
