(91, 14, 'c2', 'ldg_gear_brk', 'With a total loss of hydraulic system #1, the landing gear:', 'Must be extended with the freefall actuator.', 'Cannot be retracted once extended.', 'Operates using hydraulic system #2 pressure, but may be slower due to the priority valve', 'A and B are correct.', 'd'),
(91, 177, 'mc', 'ldg_gear_brk', 'If engine 1 is shutdown, how is the landing gear extended?', 'The landing gear freefalls as soon as engine 1 is shutdown.', 'With the landing gear handle as normal.', 'Using the electrical override switch.', 'Pulling the freefall lever.', 'b'),
(91, 190, 'tf', 'ldg_gear_brk', 'The purpose of the landing gear over-center brace is to keep the landing gear down and locked.', 'TRUE', 'FALSE', '', '', 'a'),
(91, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'DC bus.', 'Photo luminescent; no power source required.', 'Dedicated batteries.', 'Essential bus.', 'c'),
(91, 202, 'mc', 'lighting', 'What is the power source for the nose landing light?', 'Shed.', 'Essential.', 'Backup bus.', 'None of the above.', 'a'),
(91, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '300 amps.', '400 amps.', '250 amps.', '350 amps.', 'a'),
(91, 222, 'mc', 'limitations', 'On the takeoff roll, oil pressure reaches 118 PSI. The correct action is to ...', 'Disregard - this is a normal oil pressure on takeoff.', 'Abort the takeoff if below 80 knots.', 'Continue takeoff and start your timer.  Youa re time limited to 2 minutes.', 'None of the above.', 'c');
