(92, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'The air leaving the pack is too hot.', 'Air leaving the pack is too hot.', 'Air leaving the pre-cooler is too hot.', 'None of the above.', 'c'),
(92, 246, 'ac', 'pneum', 'During a bleed leak.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'The engine bleed valve should automatically close.', 'Hot bleed air is escaping from the bleed lines.', 'All of the above.', 'd'),
(92, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'All bleeds open, PACKs on, cross bleed open.', 'b'),
(92, 255, 'mc', 'powerplant', 'The A1/E engines are limited to ___ ITT.', '901 continuous.', '992 C for 90 seconds and up to 970 C for 5 minutes.', '948 C.', '880 for starting.', 'b'),
(92, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '2 minutes.', '5 minutes.', '3 minutes.', 'All of the above.', 'a'),
(92, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N2 via a linkage on the HP spool.', 'Reduction gears via the N1 turbine.', 'N2 via the tower shaft.', 'N1 via the tower shaft.', 'c'),
(92, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Presents the FADEC NO DISP EICAS.', 'Limits N1 to 106%.', 'Automatically shuts down the engine.', 'All of the above.', 'c'),
(92, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '800 C.', '868 C.', '506 C.', '901 C.', 'a'),
(92, 24, 'ac', 'powerplant', 'The engine has:', 'A 2 stage high-pressure turbine.', '6 stages of CVG vanes.', 'A 14 stage compressor.', 'All of the above.', 'd'),
(92, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine keeps running but thrust cannot be changed.', 'The engine shuts down.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine keeps running in N1 reversionary mode.', 'b'),
(92, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'The FADEC reduces the thrust to idle automatically.', 'The thrust reverser stows automatically.', 'The engine shuts down automatically.', 'None of the above.', 'a'),
(92, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'Engine page 1 automatically appears on RMU1.', 'The engine reverts to N1SYN mode.', 'The engines shuts down.', 'FADEC "A" automatically takes over.', 'd'),
(92, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Cruise altitude.', 'Landing elevation.', 'Takeoff elevation.', 'All of the above.', 'b'),
(92, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Will depressurize up to FL370.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'A and C are correct.', 'd'),
(92, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '1700'' AGL.', '14,000'' +/- 500''.', '25,000''.', '24,600''.', 'c'),
(92, 276, 'mc', 'profiles', 'During takeoff, if an engine fire is indicated after V1:', 'Continue the takeoff and perform the engine fire QRH after reaching a safe altitude.', 'The takeoff should be aborted if sufficient runway remains.', 'Perform the engine fire QRH at acceleration height after reaching Vfs.', 'None of the above.', 'a'),
(92, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'Increasing gain increases the energy output from the antenna.', 'The radar cannot be used on the ground.', 'GMAP mode is only available during ground operations.', 'Increasing gain increases receiver sensitivity.', 'd'),
(92, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Amber.', 'Red.', 'White', 'Green.', 'b'),
(92, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'd'),
(93, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(93, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the compressor is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the pack is too hot.', 'All of the above.', 'c'),
(93, 25, 'mc', 'air_condition', 'At 2000 AGL in CLB thrust mode, icing conditions, both packs selected ON:', 'Pack 1 is on, 2 is off.', 'Both packs are on.', 'Pack 2 is on, 1 is off.', 'All of the above.', 'c'),
(93, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Forward nose hydraulic compartment.', 'Overwing emergency exit.', 'Baggage compartment door.', 'Under cockpit access hatch.', 'd'),
(93, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '160 % of the length of an EMB-135.', '89 feet in length.', '110 feet in length.', '98 feet in length.', 'd'),
(93, 17, 'c2', 'apu', 'What power sources can be used to start the APU?', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'Battery 1.', 'A and B are correct.', 'd'),
(93, 9, 'mc', 'apu', 'The APU (Model T-62T-40C14) is controlled by a(n):', 'Manual controls', 'FADEC', 'EICAS', 'Starter/Generator', 'b'),
(93, 48, 'mc', 'autopilot', 'What pitch attitude does the aircraft to to hold in the go-around sub-mode for the first twenty seconds (airspeed > 1.23VS)?', 'The aircraft does not hold a specific pitch attitude during the first 20 seconds of this sub-mode.', '10 Degrees', '14 degrees (once you are flaps 9).', '13 Degrees.', 'b'),
(93, 41, 'mc', 'autopilot', 'During descent, FLC works just like:', 'VS mode but with preset vertical speeds', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'SPD mode but with preset speeds.', 'a'),
(93, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 18).', 'A and B are correct.', 'd'),
(93, 50, 'mc', 'autopilot', 'On LR aircraft above 12,000 in FLC, the aircraft climbs at...', '290 KIAS until MACH 0.56', '270 KIAS until MACH 0.56', '270 KIAS until MACH 0.65', '2000 fpm', 'b'),
(93, 36, 'mc', 'autopilot', 'At what altitude must the autopilot be disengaged on a CAT I ILS approach?', '500'' AGL.', '1000'' AGL.', '1500'' AGL.', '200'' AGL.', 'd'),
(93, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(93, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By a 5G impact or immersion in water.', 'As soon as the electrical system is powered.', 'By turning on the red beacon.', 'All of the above.', 'b'),
(93, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(93, 64, 'mc', 'crew_awareness', 'How many transponders are on the aircraft?', '2', '3', '1', 'None of the above.', 'a'),
(93, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'Aft aircraft systems information is unavailable.', 'Engine #1 indications are replaced with amber dashes', 'DAU 1B automatically takes over.', 'The FADEC syncs N2 to N1.', 'b'),
(93, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot 2/Static ports 2 & 3.', 'Pitot/Static tube 3', 'Pitot 1/Fadec pressurization static port.', 'Pitot 1/Static ports 1 & 4.', 'b'),
(93, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'The cross-side AHRS automatically takes over.', 'Airspeed will be covered with hash marks', 'ATT FAIL appears on the EADI on the PFD.', 'None of the above.', 'c'),
(93, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'MFD 1.', 'It doesn''t appear anywhere immediately.', 'TBCH.', 'RMU 1.', 'b'),
(93, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'Both aural channels have failed.', 'DAU2B has failed.', 'The digital audio panel is inoperative.', 'None of the above.', 'a'),
(93, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Approaching maximum airspeed (redline).', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'None of the above.', 'a'),
(93, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Normal gear extension.', 'Roll trim.', 'Pressurization.', 'Flaps.', 'a'),
(93, 1, 'tf', 'elec', 'The emergency light system is powered from Essential DC Bus 2.', 'TRUE', 'FALSE', '', '', 'b'),
(93, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BC 1 and BC 2 are open.', 'The ALC is closed if the APU has been started.', 'BTC 1 & 2 are open.', 'All of the above.', 'a'),
(93, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(93, 13, 'mc', 'elec', 'What items are available in essential power?', 'SG2, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS1, DAU1B, DAU2B', 'FMS, PFD and MFDs.', 'b'),
(93, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Removes power from the backup flight instruments.', 'Opens the BBC, isolating the backup battery hot bus.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Allows a test of the ISIS on LR aircraft.', 'b'),
