(93, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Four, 24 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Five, 24 Volt DC generators.', 'Four, 28 Volt DC generators.', 'b'),
(93, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'VOR-DME approaches can be flown using the standby instruments.', 'a'),
(93, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and FADECs.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'd'),
