(93, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'c'),
(93, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '1', '2', '0', '3', 'd'),
(93, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The engine bleed and lip anti-ice ice valves.', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven fuel pump.', 'All of the above.', 'd'),
(93, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Start/Stop Selector - STOP.', 'Thrust lever - IDLE.', 'Fire extinguishing handle - PULL & ROTATE.', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'b'),
(93, 113, 'mc', 'fire_prot', 'Which of the following messages would indicate a good fire test?', 'APU Fire Loop Fail', 'E1(2) Fire Det Fail.', 'Lav Smoke', 'E1(2) EXTBL A(B) INOP', 'b'),
(93, 119, 'mc', 'flt_control', 'The electromechanical gust lock inserts locking pins into:', 'Inboard spoilers while in flight.', 'Ailerons.', 'Rudder.', 'Elevator', 'd'),
(93, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '9 Degrees.', '18 Degrees.', '22 Degrees.', 'A and B are correct.', 'd'),
(93, 116, 'mc', 'flt_control', 'In essential power, the flaps:', 'Are operative under manual reversion.', 'Will not operate.', 'Will operate at half speed.', 'Operate normally.', 'b'),
(93, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The inboard and outboard spoilers deploy using both systems.', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'None of the above.', 'c'),
(93, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'A low TLA (thrust lever angle).', 'The flap lever has to be at 0 or 9 degrees.', 'The speedbrake lever has to be selected to OPEN.', 'All of the above.', 'd'),
(93, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the LR is ___ lbs.', '100.', '1000.', '800.', '365.', 'c'),
(93, 138, 'mc', 'fuel', 'If the fuel boost bump fails:', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will continue to run by suction feed through a check valve.', 'The engine will eventually flame out due to lack of fuel.', 'b'),
(93, 136, 'mc', 'fuel', 'To balance fuel:', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the pump in the low tank off.', 'b'),
(93, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(93, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'One wing tank reaches 1863 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'c'),
(93, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Emergency brakes only, supplying 6 applications.', 'Outboard spoilers, inboard brakes, emergency brakes.', 'Inboard spoilers, outboard brakes, landing gear.', 'Emergency brakes only, unlimited applications.', 'a'),
(93, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Turns on the electric pump only if the engine is shut down.', 'Places the electric hydraulic pump in a standby condition.', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'Turns on the electric pump regardless of system pressure.', 'd'),
