(93, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '2900 psi.', '1200 psi.', '1600 psi.', '3000 psi.', 'd'),
(94, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(94, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air entering the compressor is too hot.', 'The air entering the pack is too hot.', 'The air leaving the pack is too hot.', 'None of the above.', 'c'),
(94, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Both packs are off.', 'Pack 1 is on, 2 is off.', 'Both packs are on.', 'Pack 2 is on, 1 is off.', 'd'),
(94, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Under cockpit access hatch.', 'Overwing emergency exit.', 'Baggage compartment door.', 'None of the above.', 'a'),
