(94, 17, 'c2', 'apu', 'What power sources can be used to start the APU?', 'Battery 1.', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'B and C are correct.', 'd'),
(94, 52, 'tf', 'autopilot', 'The autopilot will not engage with the YD inoperative', 'TRUE', 'FALSE', '', '', 'a'),
(94, 48, 'mc', 'autopilot', 'What pitch attitude does the aircraft to to hold in the go-around sub-mode for the first twenty seconds (airspeed > 1.23VS)?', 'The aircraft does not hold a specific pitch attitude during the first 20 seconds of this sub-mode.', '14 degrees (once you are flaps 9).', '13 Degrees.', '10 Degrees', 'd'),
