(94, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'Airspeed will be covered with hash marks', 'ATT FAIL appears on the EADI on the PFD.', 'The cross-side AHRS automatically takes over.', 'None of the above.', 'b'),
