(94, 77, 'tf', 'crew_awareness', 'The standby airspeed indicator receives information from the ADCs.', 'TRUE', 'FALSE', '', '', 'b'),
(94, 76, 'mc', 'crew_awareness', 'The ELT battery:', 'Is charged by the esential busses', 'Is charged by the shed buses', 'Is charged only when the ELT switch is in the ARM position.', 'Is not charged.', 'd'),
(94, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'A disagreement between IC-600''s on EICAS messages displayed.', 'IAS displayed on each PFD differs by more than 5 knots.', 'SG reversion has been selected.', 'Altitude displayed on each PFD differs by more than 200 feet.', 'a'),
(94, 81, 'mc', 'crew_awareness', 'The power source for SG 2 is:', 'Essential bus 2', 'Essential bus 1', 'DC bus 1', 'DC Bus 2', 'd'),
(94, 63, 'tf', 'crew_awareness', 'COM 3 cannot be used for voice communication when the EMER button is pushed in (selected) on the digital audio panel.', 'TRUE', 'FALSE', '', '', 'a'),
