(94, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(94, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS, PFD and MFDs.', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS1, DAU1B, DAU2B', 'SG2, DAU2B', 'b'),
