(94, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The hydraulic shutoff valve to the engine-driven fuel pump.', 'The fuel shutoff valve.', 'The engine bleed and lip anti-ice ice valves.', 'All of the above.', 'd'),
(94, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV SMOKE EICAS warning appears.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd'),
(94, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(94, 124, 'tf', 'flt_control', 'The ground spoilers open when the airplane is on the ground, wheel speed >25 kts and a low TLA.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(94, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '22 Degrees.', '18 Degrees.', '45 Degrees.', 'A and C are correct.', 'd'),
