(95, 199, 'mc', 'lighting', 'Aisle path lighting in the XR consists of:', 'A steady set of green lights powered by DC bus 1.', 'There is no aisle path lighting.', 'Photo luminescent lighting.', 'Red and white lights powered by the backup battery.', 'c'),
(95, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'No.', 'Only if the crossfeed is on.', 'All of the above.', 'a'),
(95, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Pitch systems 1 & 2 off.', 'Actuate the pitch trim switch in the opposite direction.', 'Control column hold firmly.', 'Quick disconnect button, press and hold.', 'c'),
(95, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL 370.', 'FL350.', 'FL410.', 'FL450.', 'a'),
(95, 221, 'mc', 'limitations', 'The engines have been running for 8 minutes and the oil temperature is 40 C.  What action is appropriate?', 'Takeoff.', 'Notify maintenance and return to the gate.', 'Delay takeoff until the oil temperature is above 40 C.', 'Complete a static run-up to 88% N2 and allow the engines to stabilize.', 'a'),
(95, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '250 knots.', '240 knots.', '180 knots.', '200 knots.', 'd'),
(95, 222, 'mc', 'limitations', 'On the takeoff roll, oil pressure reaches 118 PSI. The correct action is to ...', 'Abort the takeoff if below V1.', 'Continue takeoff and start your timer.  Youa re time limited to 2 minutes.', 'Abort the takeoff if below 80 knots.', 'Disregard - this is a normal oil pressure on takeoff.', 'b'),
(95, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '250 amps.', '300 amps.', '350 amps.', '400 amps.', 'b'),
