(95, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th compressor stage in icing conditions.', 'The 14th stage compressor only.', 'A and B are correct.', 'd'),
(95, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, closed.', 'AUTO, open.', 'OPEN, open.', 'CLOSED, closed.', 'a'),
