(95, 246, 'ac', 'pneum', 'During a bleed leak.', 'The engine bleed valve should automatically close.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'All of the above.', 'd'),
