(95, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'Provide static information to the CPAM.', 'Provide static information to the ADCs.', 'a'),
(95, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Vfs.', 'Above a safe altitude.', 'Positive rate of climb.', 'Reaching acceleration height and then a speed of V2 + 15.', 'd'),
