(96, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(96, 85, 'mc', 'crew_awareness', 'What does it look like on the 5 cockpit screens when you lose DC Bus 2?', 'PFD 2 and MFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'c'),
(96, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'DAU2B has failed.', 'The digital audio panel is inoperative.', 'Both aural channels have failed.', 'Only one aural channel is working.', 'c'),
