(96, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By turning on the navigation lights.', 'By turning on the red beacon.', 'By a 5G impact or immersion in water.', 'As soon as the electrical system is powered.', 'd'),
(96, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Over-wing emergency exit.', 'Main cabin door only.', 'Fuel and baggage doors.', 'Main and service doors.', 'd'),
