(96, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Opens the BBC, isolating the backup battery hot bus.', 'Removes power from the backup flight instruments.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Allows a test of the ISIS on LR aircraft.', 'a'),
(96, 1, 'tf', 'elec', 'The emergency light system is powered from Essential DC Bus 2.', 'TRUE', 'FALSE', '', '', 'b'),
(96, 91, 'tf', 'elec', 'With 4 generators on-line, the electrical system operates as two separate systems.', 'TRUE', 'FALSE', '', '', 'a'),
(96, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS, PFD and MFDs.', 'FMS1, DAU1B, DAU2B', 'SG2, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'd'),
(96, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You have one electrical system despite having 4 or more generators on-line.', 'You are not in the essential power configuration but should be.', 'You are in essential power configuration but should not be.', 'Is normal during a loss of all generators.', 'b'),
(96, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'The Enhanced Emergency Master Kit (EEMK)', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'a'),
