(96, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '1 Halon fire bottle for the lavatory.', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', 'A and B are correct.', 'd'),
(96, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '2', '3', '0', 'None of the above.', 'b'),
