(96, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'DC Bus 1.', 'The essential buses.', 'DC Bus 2.', 'The shed bus.', 'b'),
(96, 183, 'mc', 'ldg_gear_brk', 'In essential power, nosewheel steering:', 'Is not available.', 'Operates normally.', 'Is available, but with limited capability.', 'Operates normally, but only above 10 knots.', 'a'),
(96, 181, 'mc', 'ldg_gear_brk', 'The maximum landing gear retraction speed is:', '250 KIAS.', '200 KIAS.', '145 KIAS.', '320 KIAS or M 0.78.', 'b'),
