(96, 194, 'mc', 'lighting', 'Charging the XR photo luminescent aisle lights is the responsibility of the:', 'They no longer need to be charged.', 'Gate agent.', 'Maintenance.', 'Flight crew.', 'd'),
(96, 202, 'mc', 'lighting', 'What is the power source for the nose landing light?', 'Backup bus.', 'DC.', 'Essential.', 'Shed.', 'd'),
(96, 208, 'mc', 'limitations', 'What is the minimum oil temperature required to increase N2 above 83%?', '40 degrees F.', '40 degrees C.', '20 degrees F.', '20 degrees C.', 'b'),
