(98, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The rudder is in manual reversion.', 'The deflection is 5 degrees +/- 1 degree.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'c'),
(98, 128, 'mc', 'flt_control', 'During normal cruise flight, the rudder Power Control Unit receives hydraulic pressure from:', 'Hydraulic system 1.', 'Both hydraulic systems.', 'Hydraulic system 2.', 'All of the above.', 'c'),
(98, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The flaps are extended to 22 degrees.', 'Hydraulic system 1 fails.', 'The thrust levers are in idle.', 'The gear is down.', 'a'),
(98, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a'),
(98, 137, 'tf', 'fuel', 'The ventral tank fuel transfer can take place while crossfeeding.', 'TRUE', 'FALSE', '', '', 'b'),
(98, 138, 'mc', 'fuel', 'If the fuel boost bump fails:', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run by suction feed through a check valve.', 'b'),
(98, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used from the ventral tank first, then from the wings.', 'c'),
(98, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 1.', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 2.', 'b'),
(98, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(98, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'MFD ECS/AI page.', 'The RMU Engine page 1.', 'EICAS.', 'None of the above.', 'd'),
(98, 157, 'mc', 'hydraulics', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'b'),
(98, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '3000 psi.', '2900 psi.', '0 psi.', '1600 psi.', 'c'),
(98, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Hydraulic system 1 only.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Both hydraulic systems.', 'None of the above.', 'c'),
(98, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The landing extends normally.', 'The flaps will not extend.', 'The landing gear retracts normally.', 'The flaps operate normally.', 'd'),
(98, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'The essential buses.', 'The shed bus.', 'DC Bus 2.', 'DC Bus 1.', 'a'),
(98, 170, 'mc', 'ice_rain_prot', 'During the first part of ice test B (ground portion), which of the following should occur?', 'ICE CONDITION EICAS message.', '4 ''open'' inscriptions on the overhead panel.', 'AOA 1(2) HEAT INOP.', 'Hold the test switch for twenty seconds.', 'a'),
(98, 171, 'mc', 'ice_rain_prot', 'Ice test A requires:', 'Override to AUTO.', 'The override to ENG/test switch held for 20 seconds in each position.', 'Override to AUTO for a minimum of 10 seconds, maximum 30 seconds.', 'Override to ALL, test switch for 10 seconds minimum.', 'd'),
(98, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'Not available.', 'On and cannot be turned off.', 'Available if selected on or in icing conditions.', 'All of the above.', 'b'),
(98, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'The XR has boots.', 'There are clear ice-detectors on the wings.', 'All of the above.', 'c'),
(98, 178, 'c2', 'ldg_gear_brk', 'If down to hydraulic accumulator 2 only, the aircraft has:', 'At least 6 emergency brake applications.', 'Unlimited emergency brake applications.', 'Parking brake pressure for 24 hours.', 'A and C are correct.', 'd'),
(98, 183, 'mc', 'ldg_gear_brk', 'In essential power, nosewheel steering:', 'Operates normally.', 'Operates normally, but only above 10 knots.', 'Is available, but with limited capability.', 'Is not available.', 'd'),
