(98, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', 'No maximum exists provided the roll trim is operative.', '900 lbs.', '800 lbs.', '100 lbs.', 'c'),
(98, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-20 F.', '-40 F.', '-40 C.', '-20 C.', 'c'),
(98, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 25 C.', 'ISA + 15 C.', 'ISA + 35 C.', 'ISA + 45 C.', 'c'),
(98, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL350.', 'FL200.', 'FL370.', 'FL300.', 'd'),
(98, 208, 'mc', 'limitations', 'What is the minimum oil temperature required to increase N2 above 83%?', '20 degrees F.', '20 degrees C.', '40 degrees C.', '40 degrees F.', 'c'),
(98, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'Yes, provided the flight crew advises ATC.', 'No.', 'Only if the crossfeed is on.', 'a'),
(98, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Quick disconnect button, press and hold.', 'Pitch systems 1 & 2 off.', 'Control column hold firmly.', 'All of the above.', 'c'),
