(98, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL410.', 'FL 370.', 'FL350.', 'FL450.', 'b'),
(98, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-40.', '20.', '-20.', '-65.', 'a'),
