(98, 220, 'mc', 'limitations', 'The maximum ITT for engine start is ___.', '560 C.', '750 C.', '565 C.', '800 C.', 'd'),
(98, 232, 'mc', 'oxy', 'Placing the passenger oxygen knob to ON will deploy the oxygen masks:', 'Anytime power is supplied.', 'Only in flight.', 'When cabin altitude exceeds 14,000 feet.', 'All of the above.', 'a'),
(98, 235, 'mc', 'oxy', 'To ensure adequate oxygen for dispatch, one must know the number of crew, oxygen pressure and:', 'Outisde air temperature.', 'Actual ramp temperature.', 'Cockpit temperature.', 'Current ATIS temperature.', 'c'),
(98, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'Open inscription, no line.', 'No line, no open inscription.', 'A line, no OPEN inscription.', 'd'),
(98, 247, 'mc', 'pneum', 'Wen will the crossbleed valve open automatically when in the "AUTO" position?', 'When the override knob on the ice protection panel is in ENG.', 'During ice test A.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'During a cross-bleed start.', 'd'),
(98, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'All bleeds open, PACKs on, cross bleed open.', 'c'),
