(98, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Fails and the other FADEC takes over.', 'Automatically shuts down the engine.', 'Limits N1 to 106%.', 'All of the above.', 'b'),
(98, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engine reverts to N1SYN mode.', 'Engine page 1 automatically appears on RMU1.', 'FADEC "A" automatically takes over.', 'The engines shuts down.', 'c'),
