(98, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Will depressurize up to FL370.', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'B and C are correct.', 'd'),
