(100, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'DAU2B has failed.', 'Both aural channels have failed.', 'Only one aural channel is working.', 'The digital audio panel is inoperative.', 'b'),
(100, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Flaps.', 'Pressurization.', 'Normal gear extension.', 'Roll trim.', 'c'),
(100, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Removes power from the backup flight instruments.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Opens the BBC, isolating the backup battery hot bus.', 'All of the above.', 'c'),
(100, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'A and B are correct.', 'd'),
