(100, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a flap motor failure.', 'Indicates a failure of the teleflex cable.', 'Indicates a failure of the flap velocity sensor.', 'Indicates a mis-threading of the ball-screw actuator.', 'a'),
