(101, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '24.0V', '23.5V', '20.0V', '19.0V', 'd'),
(101, 38, 'mc', 'autopilot', 'During climb, FLC works just like:', 'VS but with preset vertical speeds.', 'SPD but with preset speeds.', 'SPD with preset values below 10,000'' and VS with preset values above 10,000''.', 'PIT but with preset attitudes.', 'b'),
(101, 48, 'mc', 'autopilot', 'What pitch attitude does the aircraft to to hold in the go-around sub-mode for the first twenty seconds (airspeed > 1.23VS)?', '14 degrees (once you are flaps 9).', '10 Degrees', '13 Degrees.', 'The aircraft does not hold a specific pitch attitude during the first 20 seconds of this sub-mode.', 'b'),
(101, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(101, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'Altitude displayed on each PFD differs by more than 200 feet.', 'A disagreement between IC-600''s on EICAS messages displayed.', 'IAS displayed on each PFD differs by more than 5 knots.', 'SG reversion has been selected.', 'b'),
(101, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(101, 77, 'tf', 'crew_awareness', 'The standby airspeed indicator receives information from the ADCs.', 'TRUE', 'FALSE', '', '', 'b'),
