(101, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS1, DAU1B, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'SG2, DAU2B', 'FMS, PFD and MFDs.', 'b'),
