(101, 137, 'tf', 'fuel', 'Crossfeeding will not inhibit transfer of fuel from the ventral tank to the wing tanks.', 'TRUE', 'FALSE', '', '', 'b'),
(101, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the pump in the low tank off.', 'b'),
(101, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'MFD ECS/AI page.', 'EICAS.', 'The RMU Engine page 1.', 'None of the above.', 'd'),
(101, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The landing extends normally.', 'The landing gear retracts normally.', 'The flaps operate normally.', 'All of the above.', 'c'),
(101, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Uses bleed air from the 9th stage of the compressor.', 'Cannot be activated unless ice is detected.', 'Fails closed (OFF) in essential power.', 'None of the above.', 'd'),
(101, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'Available if selected on or in icing conditions.', 'Not available.', 'Comes from the 9th stage of the compressor only.', 'On and cannot be turned off.', 'd'),
(101, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'The essential buses.', 'DC Bus 2.', 'The shed bus.', 'DC Bus 1.', 'a'),
(101, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'Ice detectors.', 'The leading edge of the wings and the horizontal stabilizer.', 'TAT probes.', 'A and C are correct.', 'd'),
(101, 177, 'mc', 'ldg_gear_brk', 'If engine 1 is shutdown, how is the landing gear extended?', 'Using the electrical override switch.', 'With the landing gear handle as normal.', 'Pulling the freefall lever.', 'The landing gear freefalls as soon as engine 1 is shutdown.', 'b'),
(101, 183, 'mc', 'ldg_gear_brk', 'In essential power, nosewheel steering:', 'Operates normally, but only above 10 knots.', 'Is available, but with limited capability.', 'Is not available.', 'Operates normally.', 'c'),
