(116, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-20 C.', '-40 F.', '-20 F.', '-40 C.', 'd'),
(116, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Only if the crossfeed is on.', 'Yes.', 'Yes, provided the flight crew advises ATC.', 'None of the above.', 'b'),
(116, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', '170 knots.', '160 knots.', '200 knots.', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', 'b'),
(116, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Pitch systems 1 & 2 off.', 'Quick disconnect button, press and hold.', 'Actuate the pitch trim switch in the opposite direction.', 'Control column hold firmly.', 'd'),
(116, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL200.', 'FL370.', 'FL300.', 'FL350.', 'c'),
(116, 234, 'mc', 'oxy', 'The green flight crew oxygen system safety disk:', 'Prevents contamination of the discharge line.', 'Turns red when the pressure is low.', 'May indicate that an overpressure has occurred if missing.', 'Is located within the oxygen servicing panel.', 'c'),
(116, 230, 'tf', 'oxy', 'When the passenger masks fall, the oxygen flow starts without the passengers taking any action.', 'TRUE', 'FALSE', '', '', 'b'),
(116, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air leaving the pack is too hot.', 'Air leaving the pre-cooler is too hot.', 'A massive leak detector has detected a bleed leak.', 'None of the above.', 'b'),
(116, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(116, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Low power settings.', 'External air starts.', 'Ice test A.', 'None of the above.', 'b'),
(116, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line, no OPEN inscription.', 'No line, no open inscription.', 'Open inscription, no line.', 'A line and an OPEN inscription.', 'a'),
(116, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', 'Engine oil pressure.', 'PMA.', '9th stage bleed air.', 'Fuel pressure.', 'd'),
(116, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'TO-1.', 'E-TO.', 'TO-RSV.', 'ALT-TO.', 'c'),
(116, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'FADEC "A" automatically takes over.', 'Engine page 1 automatically appears on RMU1.', 'The engines shuts down.', 'The engine reverts to N1SYN mode.', 'a'),
(116, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The FADEC itself.', 'The PMA, only above 50% N2.', 'The essential buses.', 'The PMA, only above 10% N2.', 'd'),
(116, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Static ports 2 and 3.', 'Pitot/static tube 3.', 'Static ports 1 and 4.', 'None of the above.', 'b'),
(116, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'Will depressurize up to FL370.', 'A and B are correct.', 'd'),
(116, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'During an SPS test.', 'If the airspeed is less than 200 kts.', 'If one channel of the SPS is inoperative.', 'All of the above.', 'c'),
(117, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the pack is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the compressor is too hot.', 'None of the above.', 'a'),
(117, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Pack 1 turns off.', 'Both packs turn off.', 'Both packs stay on.', 'Pack 2 turns off.', 'b'),
(117, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Overwing emergency exit.', 'Baggage compartment door.', 'Forward nose hydraulic compartment.', 'Under cockpit access hatch.', 'd'),
(117, 35, 'mc', 'apu', 'In flight, the APU will shut down automatically for which of the following?', 'Fire.', 'Overspeed.', 'High oil temperature.', 'Overtemperature.', 'b'),
(117, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '-20 C', '40 C', '70 C', '54 C', 'a'),
(117, 52, 'tf', 'autopilot', 'The autopilot will not engage with the YD inoperative', 'TRUE', 'FALSE', '', '', 'a'),
(117, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The "AP" button on the Flight Guidance Control Panel', 'Use of pitch trim', 'The quick disconnect button', 'All of the above.', 'd'),
(117, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main cabin door only.', 'Over-wing emergency exit.', 'Main and service doors.', 'All of the above.', 'c'),
(117, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(117, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'Altitude displayed on each PFD differs by more than 200 feet.', 'A disagreement between IC-600''s on EICAS messages displayed.', 'IAS displayed on each PFD differs by more than 5 knots.', 'SG reversion has been selected.', 'b'),
(117, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'SG 2', 'MAG 2, ATT 2.', 'ATT FAIL, HDG FAIL on PFD.', 'All of the above.', 'c'),
(117, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR approaches are impossible since the PFD is blank.', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'All of the above.', 'b'),
(117, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'A and C are correct.', 'd'),
(117, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS1, DAU1B, DAU2B', 'SG2, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS, PFD and MFDs.', 'c'),
(117, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '25 minutes.', '20 minutes.', '15 minutes.', '40 minutes.', 'd'),
(117, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'The Enhanced Emergency Master Kit (EEMK)', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'd'),
(117, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The engine bleed and lip anti-ice ice valves.', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'All of the above.', 'd'),
(117, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Fire extinguishing handle - PULL & ROTATE.', 'Thrust lever - IDLE.', 'Start/Stop Selector - STOP.', 'All of the above.', 'b'),
(117, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a failure of the teleflex cable.', 'Indicates a failure of the flap velocity sensor.', 'Indicates a flap motor failure.', 'All of the above.', 'c'),
(117, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'The inboard spoilers deploy using hydraulic system 1 pressure.', 'The inboard and outboard spoilers deploy using both systems.', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'a'),
(117, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'One wing tank reaches 4630 lbs + 30 seconds.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'c'),
(117, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'None of the above.', 'c'),
(117, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Outboard spoilers, inboard brakes, emergency brakes.', 'Emergency brakes only, unlimited applications.', 'Inboard spoilers, outboard brakes, landing gear.', 'Emergency brakes only, supplying 6 applications.', 'd'),
(117, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Both hydraulic systems.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Hydraulic system 1 only.', 'None of the above.', 'a'),
(117, 158, 'mc', 'ice_rain_prot', 'The SPS/ICE SPEEDS EICAS message is cleared:', 'By pressing the quick disconnect button.', 'By pressing the SPS test button at any time.', 'Once the aircraft exits icing conditions.', 'By pressing the SPS test button (on the ground only).', 'd'),
(117, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Uses bleed air from the 9th stage of the compressor.', 'Cannot be activated unless ice is detected.', 'Fails closed (OFF) in essential power.', 'None of the above.', 'd'),
(117, 163, 'mc', 'ice_rain_prot', 'To perform the A ice protection test:', 'Only engine bleed air may be used.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'All three bleed valves must be closed.', 'The engine thrust must be at a minimum of 83% N1.', 'a'),
(117, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'They are never inhbited.', 'With the FADEC Ref. anti-ice selected OFF.', 'On the ground with a wheel speed at or below 25 kts.', 'None of the above.', 'c'),
(117, 189, 'mc', 'ldg_gear_brk', 'Nosewheel steering utilizes:', 'Is electropneumatic.', 'Hydraulic system 1.', 'Both hydraulic systems.', 'None of the above.', 'b'),
(117, 175, 'mc', 'ldg_gear_brk', 'The nose wheel air/ground sensor provides a signal for:', 'The pressurization system to begin pressurizing during takeoff.', 'Removal of ground inihibtion for the weather radar.', 'Activating nosewheel steering.', 'The nose wheel doors to close.', 'c'),
(117, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'Essential bus.', 'DC bus.', 'Dedicated batteries.', 'None of the above.', 'c'),
(117, 194, 'mc', 'lighting', 'Charging the XR photo luminescent aisle lights is the responsibility of the:', 'Gate agent.', 'They no longer need to be charged.', 'Flight crew.', 'Maintenance.', 'c'),
(117, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL300.', 'FL370.', 'FL200.', 'FL350.', 'a'),
(117, 207, 'mc', 'limitations', 'While descending through 10,000 ft, you notice the LP spool vibration on engine 1 is in the amber.  After running the appropriate QRH, when must the engine be shutdown?', 'It doesn''t.', '10 seconds.', '1 minute.', 'None of the above.', 'b'),
(117, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '250 amps.', '400 amps.', '350 amps.', '300 amps.', 'd'),
(117, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Only if the crossfeed is on.', 'Yes.', 'No.', 'All of the above.', 'b'),
(117, 215, 'mc', 'limitations', 'What is VLE?', '250 knots.', '180 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '200 knots.', 'a'),
(117, 231, 'mc', 'oxy', 'In the XR with passenger oxygen masks in AUTO, the oxygen masks drop at:', '14,500'' +/- 500 cabin altitude.', '14,000'' AGL.', '14,000'' MSL.', '10,000'' cabin altitude.', 'a'),
(117, 227, 'mc', 'oxy', 'The passenger oxygen system includes:', 'Demand flow masks.', 'Two oxygen bottles, which supply the passenger oxygen masks.', 'Oxygen generators.', 'None of the above.', 'c'),
(117, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'Open inscription, no line.', 'A line, no OPEN inscription.', 'No line, no open inscription.', 'c'),
(117, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'The APU bleed valve closes.', 'Both valves can be open at the same time.', 'The engine bleed valve closes.', 'b'),
(117, 246, 'ac', 'pneum', 'During a bleed leak.', 'The engine bleed valve should automatically close.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'Hot bleed air is escaping from the bleed lines.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(117, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'All bleeds open, PACKs on, cross bleed open.', 'None of the above.', 'a'),
(117, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '5 minutes.', '2 minutes.', '3 minutes.', '1 minute.', 'b'),
(117, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The PMA only.', 'The essential buses.', 'The essential buses during an electrical emergency.', 'The essential buses or the PMA depending on N2 RPM.', 'd'),
(117, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', '56.4 percent N2.', 'Immediately after IGN is displayed on the EICAS.', '12-14 percent N2.', 'Approximately 30 percent N2.', 'd'),
(117, 265, 'mc', 'powerplant', 'Which is not an item in the engine''s accessory gear box?', 'Engine driven generator.', 'Ejector pump.', 'Ejector pump.', 'Oil pump.', 'b'),
(117, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'Immediately after the PACKs are selected during the after takeoff flow.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'All of the above.', 'b'),
(117, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'The static/pressurization ports.', 'Pitot/static tube 3.', 'Static ports 1 and 4.', 'None of the above.', 'b'),
(117, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'At 130 KIAS.', 'A and B are correct.', 'd'),
(118, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Pack 2 turns off.', 'Pack 1 turns off.', 'Both packs turn off.', 'All of the above.', 'c'),
(118, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd'),
(118, 30, 'mc', 'acft_gen', 'An EMB-145 XR is approximately...', '98 feet in length.', '160 % of the length of an EMB-135.', '89 feet in length.', '110 feet in length.', 'a'),
(118, 9, 'mc', 'apu', 'The APU (Model T-62T-40C14) is controlled by a(n):', 'FADEC', 'EICAS', 'Starter/Generator', 'All of the above.', 'a'),
(118, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '24.0V', '20.0V', '19.0V', '23.5V', 'c'),
(118, 41, 'mc', 'autopilot', 'During descent, FLC works just like:', 'VS mode but with preset vertical speeds', 'SPD mode but with preset speeds.', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'a'),
(118, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Flight Guidance Controller', 'Display Control Panel', 'Flight Director button on the Flight Guidance Control Panel', 'Flight Mode Anunciator (FMA).', 'd'),
(118, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The quick disconnect button', 'Use of pitch trim', 'The "AP" button on the Flight Guidance Control Panel', 'All of the above.', 'd'),
(118, 42, 'c2', 'autopilot', 'Which of these are vertical flight guidance modes?', 'PIT', 'FLC', 'ROL', 'A and B are correct.', 'd'),
(118, 37, 'mc', 'autopilot', 'What is the minimum engagement height for the autopilot (feet)?', '1000', '200', '800', '500', 'd'),
(118, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'SPEED HOLD flight director mode is on.', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'Approaching maximum airspeed (redline).', 'b'),
(118, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Is automatically displayed on RMU 1', 'Is powered normally.', 'Can be presented by using SG reversion.', 'Can be presented by using MFD reversion.', 'b'),
(118, 64, 'mc', 'crew_awareness', 'How many transponders are on the aircraft?', '0', '1', '2', 'None of the above.', 'c'),
(118, 58, 'tf', 'crew_awareness', 'The flight attendant can override the cockpit switch and turn the emergency lights on, regardless of the emergency light switch position in the cockpit.', 'TRUE', 'FALSE', '', '', 'a'),
(118, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(118, 81, 'mc', 'crew_awareness', 'The power source for SG 2 is:', 'Essential bus 1', 'DC bus 1', 'DC Bus 2', 'Essential bus 2', 'c'),
(118, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main and service doors.', 'Over-wing emergency exit.', 'Fuel and baggage doors.', 'All of the above.', 'a'),
(118, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(118, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'IAS displayed on each PFD differs by more than 5 knots.', 'Altitude displayed on each PFD differs by more than 200 feet.', 'SG reversion has been selected.', 'A disagreement between IC-600''s on EICAS messages displayed.', 'd'),
(118, 3, 'mc', 'crew_awareness', 'Which parameter is not evaluated for a takeoff configuration check?', 'Pitch trim set to 0 degrees.', 'One or both enginges not running.', 'Flaps 0.', 'None of the above.', 'b'),
(118, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'VOR-DME approaches can be flown using the standby instruments.', 'a'),
(118, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BTC 1 & 2 are open.', 'BC 1 and BC 2 are open.', 'BC 1 and BC 2 are closed.', 'The ALC is closed if the APU has been started.', 'b'),
(118, 90, 'tf', 'elec', 'The ground service bus is only powered with the GPU NOT selected and the batteries OFF.', 'TRUE', 'FALSE', '', '', 'a'),
(118, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'EGPWS/Wind Shear.', 'Weather Radar.', 'A and B are correct.', 'd'),
(118, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(118, 92, 'c2', 'elec', 'The shed buses are powered:', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'B and C are correct.', 'd'),
(118, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Normal gear extension.', 'Roll trim.', 'Pressurization.', 'Flaps.', 'a'),
(118, 13, 'mc', 'elec', 'What items are available in essential power?', 'SG2, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS1, DAU1B, DAU2B', 'All of the above.', 'b'),
(118, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'Is normal during a loss of all generators.', 'You have one electrical system despite having 4 or more generators on-line.', 'You are not in the essential power configuration but should be.', 'None of the above.', 'c'),
(118, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered except the shed buses.', 'All DC buses are powered.', 'Only the esential buses can be powered.', 'b'),
(118, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', 'a'),
(118, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', 'The Enhanced Emergency Master Kit (EEMK)', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'b'),
(118, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV SMOKE EICAS warning appears.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd'),
(118, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'A and B are correct.', 'd'),
(118, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Closes the associated hydraulic shutoff valve.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Shuts off all hydraulic pressure on the associated side.', 'All of the above.', 'a'),
(118, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'APU fire detection and protection is available in essential power.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'All of the above.', 'd'),
(118, 128, 'mc', 'flt_control', 'During normal cruise flight, the rudder Power Control Unit receives hydraulic pressure from:', 'Hydraulic system 2.', 'Essential DC bus.', 'Hydraulic system 1.', 'Both hydraulic systems.', 'a'),
(118, 121, 'mc', 'flt_control', 'The maximum airspeed with flaps 22 is:', '160 KIAS.', '250 KIAS.', '140 KIAS.', '200 KIAS.', 'd'),
(118, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '18 Degrees.', '22 Degrees.', '45 Degrees.', 'B and C are correct.', 'd'),
(118, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '9 Degrees.', '18 Degrees.', '22 Degrees.', 'A and B are correct.', 'd'),
(118, 116, 'mc', 'flt_control', 'In essential power, the flaps:', 'Operate normally.', 'Will not operate.', 'Are operative under manual reversion.', 'Will operate at half speed.', 'b'),
(118, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(118, 140, 'mc', 'fuel', 'In essential power:', 'All fuel boost pumps are available.', 'No fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'd'),
(118, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used from the ventral tank first, then from the wings.', 'c'),
(118, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The ACOC.', 'The left fuel tank.', 'Each fuel tank.', 'The FCOC.', 'b'),
(118, 138, 'mc', 'fuel', 'If the fuel boost bump fails:', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will continue to run by suction feed through a check valve.', 'None of the above.', 'b'),
(118, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'EICAS.', 'The RMU Engine page 1.', 'MFD ECS/AI page.', 'None of the above.', 'd'),
(118, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '3000 psi.', '2900 psi.', '0 psi.', '1600 psi.', 'c'),
(118, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Nosewheel steering.', 'Emergency brakes.', 'Ailerons and rudder should all presure be lost.', 'None of the above.', 'd'),
(118, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Hydraulic system 2 only.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Hydraulic system 1 only.', 'Both hydraulic systems.', 'd'),
