(119, 234, 'mc', 'oxy', 'The green flight crew oxygen system safety disk:', 'Is located within the oxygen servicing panel.', 'Turns red when the pressure is low.', 'May indicate that an overpressure has occurred if missing.', 'Prevents contamination of the discharge line.', 'c'),
(119, 226, 'mc', 'oxy', 'With the passenger oxygen knob in AUTO (non-XR) the passenger oxygen masks drop at:', '14,000'' cabin altitude.', '9,900 +/- 100'' cabin altitude.', '14,000'' AGL.', '14,000'' MSL.', 'a'),
(119, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd'),
(119, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Cross-bleed starts.', 'External air starts.', 'Low power settings.', 'None of the above.', 'b'),
(119, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'A line, no OPEN inscription.', 'No line, no open inscription.', 'None of the above.', 'b'),
(119, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air leaving the pre-cooler is too hot.', 'Air leaving the pack is too hot.', 'The air leaving the pack is too hot.', 'All of the above.', 'a'),
(119, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'The engine bleed valve closes.', 'Both valves can be open at the same time.', 'The APU bleed valve closes.', 'd'),
(119, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'The engine bleed valve should automatically close.', 'All of the above.', 'd'),
(119, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'TO-1.', 'TO-RSV.', 'E-TO.', 'ALT-TO.', 'b'),
(119, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Presents the FADEC NO DISP EICAS.', 'Automatically shuts down the engine.', 'Fails and the other FADEC takes over.', 'Limits N1 to 106%.', 'b'),
(119, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', 'PMA.', '9th stage bleed air.', 'Engine oil pressure.', 'Fuel pressure.', 'd'),
(119, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'Shut the engine down immediately and call maintenance.', 'c'),
(119, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N2 via a linkage on the HP spool.', 'N1 via the tower shaft.', 'Reduction gears via the N1 turbine.', 'N2 via the tower shaft.', 'd'),
(119, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine shuts down.', 'The other FADEC (same engine) immediately takes over.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The engine runs in idle until the pilot resets the FADEC.', 'b'),
(119, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engines shuts down.', 'FADEC "A" automatically takes over.', 'Engine page 1 automatically appears on RMU1.', 'All of the above.', 'b'),
(119, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '800 C.', '506 C.', '868 C.', '901 C.', 'a'),
(119, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine shuts down.', 'The engine keeps running but thrust cannot be changed.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine keeps running in N1 reversionary mode.', 'a'),
(119, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Landing elevation.', 'Cruise altitude.', 'Desired cabin altitude.', 'None of the above.', 'a'),
(119, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Will depressurize up to FL370.', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'B and C are correct.', 'd'),
(119, 271, 'mc', 'pressurization', 'The maximum allowed negative cabin differential is ___ PSID:', '7.5', '8.1', '-0.3', '7.8', 'c'),
(119, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Vfs.', 'Reaching acceleration height and then a speed of V2 + 15.', 'Above a safe altitude.', 'Positive rate of climb.', 'b'),
(119, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'The radar cannot be used on the ground.', 'Increasing gain increases receiver sensitivity.', 'Increasing gain increases the energy output from the antenna.', 'GMAP mode is only available during ground operations.', 'b'),
(119, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'At 130 KIAS.', 'When the aircraft symbol touches the PLI.', 'A and C are correct.', 'd'),
(119, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If one channel of the SPS is inoperative.', 'If the airspeed is less than 200 kts.', 'During an SPS test.', 'None of the above.', 'a'),
(119, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'E1(2) EXTBL A(B) INOP', 'LAV SMOKE', 'BAGG SMOKE', 'All of the above.', 'c'),
(119, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'b'),
(119, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'Engine, wing, and stab anti-ice must be selected OFF.', 'All three bleed valves must be closed.', 'The engine thrust must be at a minimum of 83% N1.', 'The engine bleed valves must be open.', 'd'),
(119, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'All of the above.', 'a'),
(119, 285, 'mc', 'mandatory', 'Which of the following is NOT part of a successful TCAS TEST:', 'MFD shows a traffic pattern of intruder symbols', 'PFD shows a red and greeen arc', 'PFD shows a green "TCAS TEST PASS" at the end of the test', 'RMU shows a green "TCAS TEST PASS" at the end of the test', 'c'),
(120, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(120, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs stay on.', 'Only pack 1 turns off.', 'Both packs turn off.', 'All of the above.', 'c'),
(120, 30, 'mc', 'acft_gen', 'An EMB-145 XR is approximately...', '89 feet in length.', '98 feet in length.', '110 feet in length.', '160 % of the length of an EMB-135.', 'b'),
(120, 9, 'mc', 'apu', 'The APU (Model T-62T-40C14) is controlled by a(n):', 'FADEC', 'Starter/Generator', 'Manual controls', 'EICAS', 'a'),
(120, 17, 'c2', 'apu', 'What power sources can be used to start the APU?', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'Battery 1.', 'A and B are correct.', 'd'),
(120, 38, 'mc', 'autopilot', 'During climb, FLC works just like:', 'SPD but with preset speeds.', 'PIT but with preset attitudes.', 'VS but with preset vertical speeds.', 'SPD with preset values below 10,000'' and VS with preset values above 10,000''.', 'a'),
(120, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'NAV', 'HDG', 'HDG, then FMS.', 'FMS', 'a'),
(120, 44, 'mc', 'autopilot', 'When selected, low bank is equal to ____ : ?', '10 degrees.', '27 degrees.', '14 degrees.', '13 degrees above FL250.', 'c'),
(120, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 18).', 'A and B are correct.', 'd'),
(120, 39, 'mc', 'autopilot', 'When pressing the TOGA buttons on the ground while taxiing:', 'The flight director shows a 10 degree pitch up indication for takeoff.', 'TO mode is activated on the flight director.', 'GA mode is activated on the flight director.', 'The thrust rating changes to full thrust.', 'b'),
(120, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'Amber HDG flag above HSI.', 'MAG 2, ATT 2.', 'ATT FAIL, HDG FAIL on PFD.', 'None of the above.', 'c'),
(120, 85, 'mc', 'crew_awareness', 'How do the 5 cockpit CRTs appear following the loss of DC Bus 2?', 'PFD 2 and MFD 2 are blank.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'b'),
(120, 58, 'tf', 'crew_awareness', 'The flight attendant can override the cockpit switch and turn the emergency lights on.', 'TRUE', 'FALSE', '', '', 'a'),
(120, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Can be presented by using SG reversion.', 'Is powered normally.', 'Is automatically displayed on RMU 1', 'Can be presented by using MFD reversion.', 'b'),
(120, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot 1/Static ports 1 & 4.', 'Pitot 1/Fadec pressurization static port.', 'Pitot 2/Static ports 2 & 3.', 'Pitot/Static tube 3', 'd'),
(120, 76, 'mc', 'crew_awareness', 'The ELT battery:', 'Is charged only when the ELT switch is in the ARM position.', 'Is charged by the esential busses', 'Is charged by the shed buses', 'Is not charged.', 'd'),
(120, 61, 'mc', 'crew_awareness', 'The flight data recorder is activated (starts recording):', 'As soon as the electrical system is powered.', 'By turning on the red beacon', 'By turning on the NAV lights.', 'All of the above.', 'b'),
(120, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'The FMS is suggesting heading select navigation.', 'The heading system has failed.', 'A difference of 6 degrees between the left and right AHRS headings.', 'Check your heading, you''re drifting from the assigned heading.', 'c');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(120, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'TBCH.', 'MFD 1.', 'RMU 1.', 'It doesn''t appear anywhere immediately.', 'd'),
(120, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'The cross-side AHRS automatically takes over.', 'ATT FAIL appears on the EADI on the PFD.', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'Airspeed will be covered with hash marks', 'b'),
(120, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BC 1 and BC 2 are open.', 'BTC 1 & 2 are open.', 'BC 1 and BC 2 are closed.', 'The ALC is closed if the APU has been started.', 'a'),
(120, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(120, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'A and C are correct.', 'd'),
(120, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'That the GPU is plugged in with some power available.', 'The aircraft electrical system is powered.', 'The ground air supply is supplying bleed air to the packs.', 'The ground power unit is disconnected from the aircraft.', 'a'),
(120, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Flaps.', 'Roll trim.', 'Normal gear extension.', 'All of the above.', 'c'),
(120, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '20 minutes.', '15 minutes.', '40 minutes.', '25 minutes.', 'c'),
(120, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Four, 28 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Four, 24 Volt DC generators.', 'Five, 24 Volt DC generators.', 'b'),
(120, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'DC bus 2.', 'Essential bus 2.', 'Central DC bus.', 'Backup hot bus.', 'd'),
(120, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS1, DAU1B, DAU2B', 'SG2, DAU2B', 'FMS, PFD and MFDs.', 'RMU1, RMU2, EICAS and standby instruments.', 'd'),
(120, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'EGPWS/Wind Shear.', 'Weather Radar.', 'A and B are correct.', 'd'),
(120, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'The Enhanced Emergency Master Kit (EEMK)', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'c'),
(120, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', 'c'),
(120, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Fire extinguishing handle - PULL & ROTATE.', 'Start/Stop Selector - STOP.', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'Thrust lever - IDLE.', 'd'),
(120, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(120, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The flight attendant hears a warning horn.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The LAV SMOKE EICAS warning appears.', 'None of the above.', 'd'),
(120, 107, 'tf', 'fire_prot', 'APU fire detection and protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'b'),
(120, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'The deflection is 5 degrees +/- 1 degree.', 'The rudder is in manual reversion.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'd'),
(120, 127, 'mc', 'flt_control', 'Ailerons are positioned utilizing:', 'Mechanical Means.', 'Offside hydraulic pressure only.', 'Both hydraulic systems.', 'Onside hydraulic pressure only.', 'c'),
(120, 121, 'mc', 'flt_control', 'The maximum airspeed with flaps 18 is:', '160 KIAS.', '200 KIAS.', '250 KIAS.', '140 KIAS.', 'b'),
(120, 123, 'mc', 'flt_control', 'Elevator trim is accomplished by:', 'Positioning the fixed trim tab; the spring tab is a servo tab only.', 'Positioning the horizontal stabilizer.', 'Positioning the spring and fixed tabs on the trailing edges of the elevator.', 'None of the above.', 'b'),
(120, 119, 'mc', 'flt_control', 'The electromechanical gust lock inserts locking pins into:', 'Elevator', 'Rudder.', 'Ailerons.', 'Inboard spoilers while in flight.', 'a'),
(120, 136, 'mc', 'fuel', 'To balance fuel:', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'All of the above.', 'c'),
(120, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the XR is ___ lbs.', '100.', '1000.', '365.', '800.', 'd'),
(120, 140, 'mc', 'fuel', 'In essential power:', 'Only the A and B fuel boost pumps are available.', 'All fuel boost pumps are available.', 'No fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'a'),
(120, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'None of the above.', 'b'),
(120, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'b'),
(120, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '1200 psi.', '2900 psi.', '1600 psi.', '3000 psi.', 'd'),
(120, 151, 'mc', 'hydraulics', 'Hydraulic system 1 provides pressure to:', 'The inboard flaps.', 'The rudder above 135 KIAS.', 'The parking brake.', 'The nose-wheel steering.', 'd'),
(120, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '2900 psi.', '3000 psi.', '1600 psi.', '0 psi.', 'd'),
(120, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Ailerons and rudder should all presure be lost.', 'Emergency brakes.', 'Nosewheel steering.', 'None of the above.', 'd'),
(120, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Extend normally using the gear handle.', 'Freefall (freefall).', 'Are held up by system 1 accumulator pressure.', 'All of the above.', 'b'),
(120, 174, 'mc', 'ice_rain_prot', 'Which statement is true regarding the operation of the clear ice detection on an XRJ?', 'XRJ''s are not equipped with clear ice detectors.', 'In flight only, when clear ice is present on the wing.', 'On the ground only, when clear ice is present on the wing.', 'None of the above.', 'c'),
(120, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'During a bleed overtemp.', 'On the ground with a wheel speed at or below 25 kts.', 'They are never inhbited.', 'All of the above.', 'b'),
(120, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'PacK 1 is off, Pack 2 is on.', 'The engines bleeds will always be closed.', 'The engine bleeds shoud be selected open.', 'The use of packs is only permitted if the APU bleed is available.', 'c'),
(120, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Is on and cannot be turned off.', 'Is not available.', 'Is available with the override switch in ALL.', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'b'),
(120, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'Ice detectors.', 'The leading edge of the wings and the horizontal stabilizer.', 'TAT probes.', 'A and C are correct.', 'd'),
(120, 189, 'mc', 'ldg_gear_brk', 'Nosewheel steering utilizes:', 'Is electropneumatic.', 'Hydraulic system 1.', 'Hydraulic system 2.', 'Both hydraulic systems.', 'b'),
(120, 178, 'c2', 'ldg_gear_brk', 'If down to hydraulic accumulator 2 only, the aircraft has:', 'Unlimited emergency brake applications.', 'At least 6 emergency brake applications.', 'Parking brake pressure for 24 hours.', 'B and C are correct.', 'd'),
(120, 187, 'mc', 'ldg_gear_brk', 'On the nose landing gear tires, the chines are mounted:', 'Inboard.', 'inboard on XR''s only.', 'Nose landing gear tires do not have chines.', 'Outboard.', 'd'),
(120, 200, 'mc', 'lighting', 'The emergency light batteries are charged with normal power established on the aircraft and when the emergency light switch is in the:', 'Are not charged and replaced periodically by maintenance.', 'ARM position.', 'ON position.', 'None of the above.', 'b'),
(120, 198, 'mc', 'lighting', 'The courtesy lights:', 'Automatically shut off when the airplane is depowered.', 'Come on automatically when normal power is lost.', 'Knob must be left in the AUTO position.', 'Could deplete battery 2 unless turned OFF.', 'd'),
(120, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS below 10,000 feet.', '250 KIAS or MACH .63, whichever is higher.', '250 KIAS or MACH .63, whichever is lower.', '200 KIAS.', 'd'),
(120, 211, 'mc', 'limitations', 'The maximum tailwind component for takeoff and landing is ___.', '30 knots.', '10 knots.', '15 knots.', '20 knots.', 'b'),
(120, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-20 C.', '-20 F.', '-40 F.', '-40 C.', 'd'),
(120, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-30 C.', '-65 C.', '-52 C.', '-45 C with momentary deviations to -50 C permitted.', 'd'),
(120, 215, 'mc', 'limitations', 'What is VLE?', '200 knots below 10,000 and 180 knots when above 10,000.', '250 knots.', '180 knots.', '200 knots.', 'b'),
(120, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL200.', 'FL300.', 'FL370.', 'FL350.', 'b'),
(120, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes, provided the flight crew advises ATC.', 'Only if the crossfeed is on.', 'No.', 'Yes.', 'd'),
(120, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 15 C.', 'ISA + 45 C.', 'ISA + 25 C.', 'ISA + 35 C.', 'd'),
(120, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Quick disconnect button, press and hold.', 'Pitch systems 1 & 2 off.', 'Control column hold firmly.', 'Actuate the pitch trim switch in the opposite direction.', 'c'),
(120, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', '100 lbs.', 'No maximum exists provided the roll trim is operative.', '800 lbs.', '900 lbs.', 'c'),
(120, 231, 'mc', 'oxy', 'In the XR with passenger oxygen masks in AUTO, the oxygen masks drop at:', '14,500'' +/- 500 cabin altitude.', '10,000'' cabin altitude.', '14,000'' MSL.', '14,000'' AGL.', 'a'),
(120, 237, 'mc', 'oxy', 'In order to test the First Officer''s oxygen mask,', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, twist to Emergency.', 'b'),
(120, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves can be open at the same time.', 'The APU bleed valve closes.', 'Both valves close.', 'None of the above.', 'b'),
(120, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line, no OPEN inscription.', 'Open inscription, no line.', 'No line, no open inscription.', 'A line and an OPEN inscription.', 'a'),
(120, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(120, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, open.', 'AUTO, closed.', 'OPEN, open.', 'CLOSED, closed.', 'b'),
(120, 247, 'mc', 'pneum', 'Wen will the crossbleed valve open automatically when in the "AUTO" position?', 'During a cross-bleed start.', 'When the override knob on the ice protection panel is in ENG.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'All of the above.', 'a'),
(120, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'The engine bleed valve should automatically close.', 'All of the above.', 'd'),
(120, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', '9th stage bleed air.', 'Engine oil pressure.', 'Fuel pressure.', 'All of the above.', 'c'),
(120, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The essential buses.', 'The FADEC itself.', 'The PMA, only above 10% N2.', 'None of the above.', 'c'),
(120, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD takeoff page.', 'MFD Hydraulic page.', 'RMU maintenance page.', 'EICAS.', 'a'),
(120, 24, 'ac', 'powerplant', 'The engine has:', '6 stages of CVG vanes.', 'A 14 stage compressor.', 'A 2 stage high-pressure turbine.', 'All of the above.', 'd'),
(120, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Limits N1 to 106%.', 'Presents the FADEC NO DISP EICAS.', 'Automatically shuts down the engine.', 'All of the above.', 'c'),
(120, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '901 C.', '868 C.', '506 C.', '800 C.', 'd'),
(120, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The other FADEC (same engine) immediately takes over.', 'The engine runs in idle until the pilot resets the FADEC.', 'The engine shuts down.', 'b'),
(120, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '3 minutes.', '2 minutes.', '5 minutes.', '1 minute.', 'b'),
