(124, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'd'),
(124, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'The engine bleed valve should automatically close.', 'All of the above.', 'd'),
(124, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'Open inscription, no line.', 'A line, no OPEN inscription.', 'A line and an OPEN inscription.', 'No line, no open inscription.', 'b'),
(124, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', 'Approximately 30 percent N2.', '12-14 percent N2.', 'Immediately after IGN is displayed on the EICAS.', '56.4 percent N2.', 'a'),
(124, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine shuts down.', 'The engine keeps running in N1 reversionary mode.', 'The engine keeps running but thrust cannot be changed.', 'b'),
(124, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Automatically shuts down the engine.', 'Presents the FADEC NO DISP EICAS.', 'Fails and the other FADEC takes over.', 'Limits N1 to 106%.', 'a'),
(124, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD Hydraulic page.', 'MFD takeoff page.', 'RMU maintenance page.', 'EICAS.', 'b'),
(124, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Desired cabin altitude.', 'Landing elevation.', 'Takeoff elevation.', 'All of the above.', 'b'),
(124, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Pitot/static tube 3.', 'Static ports 2 and 3.', 'The static/pressurization ports.', 'Static ports 1 and 4.', 'a'),
(124, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Red.', 'White', 'Amber.', 'Green.', 'a'),
(124, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'LAV SMOKE', 'BAGG SMOKE', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'b'),
(124, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'b'),
(124, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'None of the above.', 'b'),
(125, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Only pack 2 turns off.', 'Both packs turn off.', 'Both packs stay on.', 'Only pack 1 turns off.', 'b'),
(125, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'B and C are correct.', 'd'),
(125, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Forward nose hydraulic compartment.', 'Under cockpit access hatch.', 'Overwing emergency exit.', 'Baggage compartment door.', 'b'),
(125, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '70 C', '-20 C', '40 C', '54 C', 'b');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(125, 32, 'mc', 'apu', 'In case of an APU fire, the APU shuts down:', 'Immediately at all times.', 'After 10 seconds on the ground.', 'Immediately in flight.', 'All of the above.', 'b'),
(125, 39, 'mc', 'autopilot', 'What change should be observed on the FMA after clicking the TOGA buttons on the ground?', 'The thrust rating changes to full thrust.', 'GA mode is activated on the flight director.', 'TO mode is activated on the flight director.', 'The flight director shows a 10 degree pitch up indication for takeoff.', 'c'),
(125, 48, 'mc', 'autopilot', 'What pitch attitude does the aircraft hold in the go-around sub-mode for the first twenty seconds (airspeed > 1.23VS)?', 'The aircraft does not hold a specific pitch attitude during the first 20 seconds of this sub-mode.', '13 Degrees.', '14 degrees (once you are flaps 9).', '10 Degrees', 'd'),
(125, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The quick disconnect button', 'Use of pitch trim', 'The "AP" button on the Flight Guidance Control Panel', 'All of the above.', 'd'),
(125, 54, 'mc', 'autopilot', 'The FMA displays what messages after pressing the TOGA buttons on the ground?', 'ROL/VS', 'HDG/TO', 'ROL/GA', 'ROL/TO', 'd'),
(125, 55, 'mc', 'autopilot', 'What button would push on the Display Control Panel to navigation from FMS?', 'FMS', 'NAV', 'TTG', 'LNAV', 'a'),
(125, 58, 'tf', 'crew_awareness', 'The flight attendant can override the cockpit switch and turn the emergency lights on.', 'TRUE', 'FALSE', '', '', 'a'),
(125, 85, 'mc', 'crew_awareness', 'How do the 5 cockpit CRTs appear following the loss of DC Bus 2?', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'b'),
(125, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot 1/Static ports 1 & 4.', 'Pitot 2/Static ports 2 & 3.', 'Pitot/Static tube 3', 'Pitot 1/Fadec pressurization static port.', 'c'),
(125, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(125, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Is powered normally.', 'Can be presented by using MFD reversion.', 'Can be presented by using SG reversion.', 'None of the above.', 'a'),
(125, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'MAG 2, ATT 2.', 'ATT FAIL, HDG FAIL on PFD.', 'Amber HDG flag above HSI.', 'SG 2', 'b'),
(125, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The standby airspeed indicator becomes unreliable.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'A and C are correct.', 'd'),
(125, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'ATT FAIL appears on the EADI on the PFD.', 'Airspeed will be covered with hash marks', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'The cross-side AHRS automatically takes over.', 'a'),
(125, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main and service doors.', 'Over-wing emergency exit.', 'Fuel and baggage doors.', 'None of the above.', 'a'),
(125, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'DAU 1B automatically takes over.', 'Engine #1 indications are replaced with amber dashes', 'Aft aircraft systems information is unavailable.', 'The FADEC syncs N2 to N1.', 'b'),
(125, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Allows a test of the ISIS on LR aircraft.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Opens the BBC, isolating the backup battery hot bus.', 'Removes power from the backup flight instruments.', 'c'),
(125, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Four, 24 Volt DC generators.', 'Five, 24 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Four, 28 Volt DC generators.', 'c'),
(125, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'Weather Radar.', 'EGPWS/Wind Shear.', 'A and C are correct.', 'd'),
(125, 90, 'tf', 'elec', 'The ground service bus is not powered when the GPU is selected.', 'TRUE', 'FALSE', '', '', 'a'),
(125, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Pressurization.', 'Flaps.', 'Roll trim.', 'Normal gear extension.', 'd'),
(125, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and FADECs.', 'None of the above.', 'b'),
(125, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'The hot battery busses, essential busses, and the central DC bus.', 'All electrical busses except the shed busses.', 'DC bus 1 and DC bus 2', 'The entire electrical system.', 'a'),
(125, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'Only the esential buses can be powered.', 'All DC buses are powered.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered except the shed buses.', 'd'),
(125, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b'),
(125, 92, 'c2', 'elec', 'The shed buses are powered:', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'B and C are correct.', 'd'),
(125, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', 'b'),
(125, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'The Enhanced Emergency Master Kit (EEMK)', 'a'),
(125, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', '1 Halon fire bottle for the APU', '1 Halon fire bottle for the lavatory.', 'B and C are correct.', 'd'),
(125, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The engine bleed and lip anti-ice ice valves.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'The fuel shutoff valve.', 'All of the above.', 'd'),
(125, 107, 'tf', 'fire_prot', 'APU fire detection and protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'b'),
(125, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(125, 116, 'mc', 'flt_control', 'In essential power, the flaps:', 'Will not operate.', 'Will operate at half speed.', 'Operate normally.', 'Are operative under manual reversion.', 'a'),
(125, 119, 'mc', 'flt_control', 'The gust lock prevents the movement of the:', 'Ailerons.', 'Elevator', 'Inboard spoilers while in flight.', 'All of the above.', 'b'),
(125, 121, 'mc', 'flt_control', 'The maximum airspeed with flaps 22 is:', '160 KIAS.', '250 KIAS.', '140 KIAS.', '200 KIAS.', 'd'),
(125, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '9 Degrees.', '22 Degrees.', '18 Degrees.', 'A and C are correct.', 'd'),
(125, 128, 'mc', 'flt_control', 'During normal cruise flight, the rudder Power Control Unit receives hydraulic pressure from:', 'Hydraulic system 2.', 'Both hydraulic systems.', 'Hydraulic system 1.', 'None of the above.', 'a'),
(125, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'One wing tank reaches 1863 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'b'),
(125, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'All of the above.', 'b'),
(125, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the LR is ___ lbs.', '1000.', '100.', '800.', '365.', 'c'),
(125, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 1.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 1.', 'b'),
(125, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(125, 149, 'mc', 'hydraulics', 'The priority value in hydraulic system 1 provides:', 'Restricts hydraulic presure from the landing gear to the ensure pressure for the flight controls.', 'Allows hydraulic system 2 to assisty hydraulic system 1 in low pressure situations.', 'Ensures hydraulic pressure to the landing gear when operating on the electric hydraulic pump.', 'Gives hydraulic system 1 priority over hydraulic system 2.', 'a'),
(125, 148, 'c2', 'hydraulics', 'What does the AUTO position of the electric hydraulic pump knob provide?', 'The pump is kept in standby until the engine driven pump pressure drops below a set value.', 'The pump is kept in standby until the asociated engine N2 drops below a set value.', 'The pump does not operate unless the ON position is selected.', 'A and B are correct.', 'd'),
(125, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Hydraulic system 2 only.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Both hydraulic systems.', 'Hydraulic system 1 only.', 'c'),
(125, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Nosewheel steering.', 'Ailerons and rudder should all presure be lost.', 'Emergency brakes.', 'None of the above.', 'd'),
(125, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Freefall', 'Are held up by system 1 accumulator pressure.', 'Extend normally using the gear handle.', 'Are held up by a mechanical uplock.', 'a'),
(125, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'The shed bus.', 'DC Bus 1.', 'The essential buses.', 'DC Bus 2.', 'c'),
(125, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Is available with the override switch in ALL.', 'Is not available.', 'Is on and cannot be turned off.', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'b'),
(125, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'Ice detectors.', 'The leading edge of the wings and the horizontal stabilizer.', 'TAT probes.', 'A and C are correct.', 'd'),
(125, 164, 'mc', 'ice_rain_prot', 'For ice protection to be activated automatically:', 'Both ice detectors must be working and detecting ice.', 'The TAT must be less than 0 C.', 'One or both ice detectos must be detecting ice.', 'The TAT must be less than 10 C.', 'c'),
(125, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Fails closed (OFF) in essential power.', 'Uses bleed air from the 9th stage of the compressor.', 'Cannot be activated unless ice is detected.', 'None of the above.', 'd'),
(125, 176, 'mc', 'ldg_gear_brk', 'The emergency brake lines supply:', 'The inboard brakes only.', 'All 6 brakes.', 'All 4 brakes.', 'None of the above.', 'c'),
(125, 190, 'tf', 'ldg_gear_brk', 'The purpose of the landing gear over-center brace is to keep the landing gear down and locked.', 'TRUE', 'FALSE', '', '', 'a'),
(125, 189, 'mc', 'ldg_gear_brk', 'Nosewheel steering utilizes:', 'Hydraulic system 2.', 'Is electropneumatic.', 'Hydraulic system 1.', 'Both hydraulic systems.', 'c'),
(125, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'Essential bus.', 'DC bus.', 'Dedicated batteries.', 'All of the above.', 'c'),
(125, 197, 'mc', 'lighting', 'The emergency lights will last a minimum of:', '30 minutes.', '40 minutes.', '15 minutes.', '45 minutes if pitot 3 heat is turned off.', 'c'),
(125, 220, 'mc', 'limitations', 'The maximum ITT for engine start is ___.', '565 C.', '750 C.', '800 C.', '560 C.', 'c'),
(125, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL370.', 'FL350.', 'FL300.', 'FL200.', 'c'),
(125, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL410.', 'FL450.', 'FL 370.', 'FL350.', 'c'),
(125, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-65.', '-40.', '20.', '-20.', 'b'),
(125, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '180 knots.', '240 knots.', '200 knots.', '250 knots.', 'c'),
(125, 215, 'mc', 'limitations', 'What is VLE?', '180 knots.', '250 knots.', '200 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', 'b'),
(125, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Control column hold firmly.', 'Actuate the pitch trim switch in the opposite direction.', 'Pitch systems 1 & 2 off.', 'Quick disconnect button, press and hold.', 'a'),
(125, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-40 F.', '-40 C.', '-20 F.', '-20 C.', 'b'),
(125, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS or MACH .63, whichever is lower.', '250 KIAS below 10,000 feet.', '200 KIAS.', '250 KIAS or MACH .63, whichever is higher.', 'c'),
(125, 221, 'mc', 'limitations', 'The engines have been running for 8 minutes and the oil temperature is 40 C.  What action is appropriate?', 'Notify maintenance and return to the gate.', 'Takeoff.', 'Delay takeoff until the oil temperature is above 40 C.', 'Complete a static run-up to 88% N2 and allow the engines to stabilize.', 'b'),
(125, 238, 'mc', 'oxy', 'During a rapid cabin depressurization, flight dec crew members receive oxygen from...', 'An oxygen generator.', 'A fixed oxygen cylinder.', 'The PBE.', 'A portable oxygen bottle.', 'b'),
(125, 230, 'tf', 'oxy', 'When the passenger masks fall, the oxygen flow starts without the passengers taking any action.', 'TRUE', 'FALSE', '', '', 'b'),
(125, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'No line, no open inscription.', 'A line, no OPEN inscription.', 'A line and an OPEN inscription.', 'All of the above.', 'b'),
(125, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'The APU bleed valve closes.', 'The engine bleed valve closes.', 'All of the above.', 'b'),
(125, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'None of the above.', 'b'),
(125, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'External air starts.', 'Low power settings.', 'Cross-bleed starts.', 'None of the above.', 'a'),
(125, 247, 'mc', 'pneum', 'Wen will the crossbleed valve open automatically when in the "AUTO" position?', 'During a cross-bleed start.', 'During ice test A.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'When the override knob on the ice protection panel is in ENG.', 'a'),
(125, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'A massive leak detector has detected a bleed leak.', 'Air leaving the pre-cooler is too hot.', 'The air leaving the pack is too hot.', 'All of the above.', 'b'),
(125, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'ETO, TO RSV, ETO RSV.', 'ATO TO, TO RSV, ETO RSV.', 'TO, ETO, TO RSV.', 'ALT TO, TO, ETO.', 'd'),
(125, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Shut the engine down immediately and call maintenance.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'd'),
(125, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', 'Immediately after IGN is displayed on the EICAS.', '56.4 percent N2.', 'Approximately 30 percent N2.', '12-14 percent N2.', 'c'),
(125, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine keeps running in N1 reversionary mode.', 'The engine keeps running but thrust cannot be changed.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine shuts down.', 'd'),
(125, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD takeoff page.', 'RMU maintenance page.', 'MFD Hydraulic page.', 'EICAS.', 'a'),
(125, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'ALT-TO.', 'TO-1.', 'TO-RSV.', 'E-TO.', 'c'),
(125, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The essential buses.', 'The PMA, only above 50% N2.', 'The FADEC itself.', 'The PMA, only above 10% N2.', 'd'),
(125, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engine reverts to N1SYN mode.', 'Engine page 1 automatically appears on RMU1.', 'FADEC "A" automatically takes over.', 'The engines shuts down.', 'c'),
(125, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '800 C.', '868 C.', '901 C.', '506 C.', 'a'),
(125, 271, 'mc', 'pressurization', 'The maximum allowed negative cabin differential is ___ PSID:', '7.8', '8.1', '7.5', '-0.3', 'd'),
(125, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Will depressurize up to FL370.', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'B and C are correct.', 'd'),
(125, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Provide static information to the CPAM.', 'Provide static information to the ADCs.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'd'),
(125, 276, 'mc', 'profiles', 'During takeoff, if an engine fire is indicated after V1:', 'Continue the takeoff and perform the engine fire QRH after reaching V2.', 'The takeoff should be aborted if sufficient runway remains.', 'Perform the engine fire QRH at acceleration height after reaching Vfs.', 'Continue the takeoff and perform the engine fire QRH after reaching a safe altitude.', 'd'),
(125, 277, 'mc', 'radar', 'The RADAR gain knob:', 'Should always be pulled out (VAR).', 'Changes the intensity of each color displayed.', 'Should always be turned to MAX.', 'Changes the amount of energy transmitted.', 'b'),
(125, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If the airspeed is less than 200 kts.', 'If the SPS/ICE SPEEDs message is displayed.', 'If one channel of the SPS is inoperative.', 'During an SPS test.', 'c'),
(125, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'At 130 KIAS.', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'B and C are correct.', 'd'),
(125, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'LAV SMOKE', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'None of the above.', 'b'),
(125, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'c'),
(125, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'The crew must ensure that no passengers are on board.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, twist to Emergency.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'd'),
(125, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'None of the above.', 'b'),
(125, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine thrust must be at a minimum of 83% N1.', 'All three bleed valves must be closed.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'd'),
(126, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Only pack 2 turns off.', 'Both packs stay on.', 'Only pack 1 turns off.', 'a'),
(126, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Both packs are on.', 'Both packs are off.', 'Pack 2 is on, 1 is off.', 'All of the above.', 'c'),
(126, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '110 feet in length.', '89 feet in length.', '160 % of the length of an EMB-135.', '98 feet in length.', 'd'),
(126, 17, 'c2', 'apu', 'What power sources can be used to start the APU?', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'Battery 1.', 'A and B are correct.', 'd'),
