(127, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is not available.', 'Is on and cannot be turned off.', 'Is available with the override switch in ALL.', 'b'),
(127, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'They are never inhbited.', 'During a bleed overtemp.', 'With the FADEC Ref. anti-ice selected OFF.', 'On the ground with a wheel speed at or below 25 kts.', 'd'),
(127, 158, 'mc', 'ice_rain_prot', 'The SPS/ICE SPEEDS EICAS message is cleared:', 'By pressing the quick disconnect button.', 'By pressing the SPS test button at any time.', 'By pressing the SPS test button (on the ground only).', 'All of the above.', 'c');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(127, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'PacK 1 is off, Pack 2 is on.', 'The engine bleeds shoud be selected open.', 'The use of packs is only permitted if the APU bleed is available.', 'The engines bleeds will always be closed.', 'b'),
