(128, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main and service doors.', 'Fuel and baggage doors.', 'Main cabin door only.', 'Over-wing emergency exit.', 'a'),
(128, 63, 'tf', 'crew_awareness', 'COM 3 cannot be used for voice communication when the EMER button is pushed in (selected) on the digital audio panel.', 'TRUE', 'FALSE', '', '', 'a'),
(128, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'Check your heading, you''re drifting from the assigned heading.', 'The FMS is suggesting heading select navigation.', 'A difference of 6 degrees between the left and right AHRS headings.', 'The heading system has failed.', 'c'),
