(134, 41, 'mc', 'autopilot', 'During descent, FLC works just like:', 'SPD mode but with preset speeds.', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'VS mode but with preset vertical speeds', 'd'),
(134, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Flight Mode Anunciator (FMA).', 'Flight Director button on the Flight Guidance Control Panel', 'Flight Guidance Controller', 'Display Control Panel', 'a'),
(134, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The quick disconnect button', 'The "AP" button on the Flight Guidance Control Panel', 'Use of pitch trim', 'All of the above.', 'd'),
(134, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'The cross-side AHRS automatically takes over.', 'ATT FAIL appears on the EADI on the PFD.', 'Airspeed will be covered with hash marks', 'c'),
(134, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Over-wing emergency exit.', 'Main and service doors.', 'Main cabin door only.', 'All of the above.', 'b'),
(134, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(134, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'The FMS is suggesting heading select navigation.', 'Check your heading, you''re drifting from the assigned heading.', 'A difference of 6 degrees between the left and right AHRS headings.', 'The heading system has failed.', 'c'),
(134, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'Engine #1 indications are replaced with amber dashes', 'The FADEC syncs N2 to N1.', 'DAU 1B automatically takes over.', 'Aft aircraft systems information is unavailable.', 'a'),
(134, 76, 'mc', 'crew_awareness', 'The ELT battery:', 'Is charged by the esential busses', 'Is charged by the shed buses', 'Is not charged.', 'Is charged only when the ELT switch is in the ARM position.', 'c'),
(134, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'MAG 2, ATT 2.', 'ATT FAIL, HDG FAIL on PFD.', 'Amber HDG flag above HSI.', 'None of the above.', 'b'),
(134, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(134, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'Approaching maximum airspeed (redline).', 'SPEED HOLD flight director mode is on.', 'a'),
(134, 59, 'tf', 'crew_awareness', 'The TBCH is the only means of tuning NAV2 in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(134, 13, 'mc', 'elec', 'What items are available in essential power?', 'SG2, DAU2B', 'FMS, PFD and MFDs.', 'FMS1, DAU1B, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'd'),
(134, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'That the GPU is plugged in with some power available.', 'The ground power unit is disconnected from the aircraft.', 'The aircraft electrical system is powered.', 'All of the above.', 'a'),
(134, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BTC 1 & 2 are open.', 'BC 1 and BC 2 are open.', 'The ALC is closed if the APU has been started.', 'None of the above.', 'b'),
(134, 1, 'tf', 'elec', 'The emergency light system is powered from Essential DC Bus 2.', 'TRUE', 'FALSE', '', '', 'b'),
(134, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Flaps.', 'Normal gear extension.', 'Roll trim.', 'None of the above.', 'b'),
(134, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered.', 'All DC buses are powered except the shed buses.', 'Only the esential buses can be powered.', 'c'),
(134, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '25 minutes.', '20 minutes.', '40 minutes.', '15 minutes.', 'c'),
(134, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(134, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'Backup hot bus.', 'DC bus 2.', 'Central DC bus.', 'Essential bus 2.', 'a'),
(134, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'Weather Radar.', 'TCAS.', 'EGPWS/Wind Shear.', 'B and C are correct.', 'd'),
(134, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', 'b'),
(134, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'a'),
(134, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The fuel shutoff valve.', 'The engine bleed and lip anti-ice ice valves.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'All of the above.', 'd'),
(134, 104, 'mc', 'fire_prot', 'When a fire extinguishing handle is pulled:', 'The respective engine fire bottle is discharged.', 'The fuel shutoff valve closes.', 'The engine will not shut down unless the thrust lever is in idle.', 'All of the above.', 'b'),
(134, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Has no effect on the hydraulic system.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Closes the associated hydraulic shutoff valve.', 'Shuts off all hydraulic pressure on the associated side.', 'c'),
(134, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The flight attendant hears a warning horn.', 'The LAV SMOKE EICAS warning appears.', 'The LAV BOTTLE INOP EICAS warning appears.', 'None of the above.', 'd'),
(134, 120, 'tf', 'flt_control', 'When in manual reversion, the elevators, ailerons and rudder can all be actuated mechanically.', 'TRUE', 'FALSE', '', '', 'a'),
(134, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '22 Degrees.', '45 Degrees.', '18 Degrees.', 'A and B are correct.', 'd'),
(134, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The deflection is 5 degrees +/- 1 degree.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'The rudder is in manual reversion.', 'b'),
(134, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a mis-threading of the ball-screw actuator.', 'Indicates a failure of the teleflex cable.', 'Indicates a flap motor failure.', 'None of the above.', 'c'),
(134, 126, 'mc', 'flt_control', 'The flaps are powered by:', 'DC bus 1 & 2 under normal conditions; Essential buses in an electrical emergency.', 'Essential buses.', 'DC bus 1 & 2.', 'None of the above.', 'c'),
(134, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'De-energizing the boost pumps in tank 1.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 2.', 'All of the above.', 'a'),
(134, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'd'),
(134, 136, 'mc', 'fuel', 'To balance fuel:', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'c'),
(134, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The ACOC.', 'Each fuel tank.', 'The FCOC.', 'The left fuel tank.', 'd'),
(134, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the XR is ___ lbs.', '1000.', '800.', '100.', '365.', 'b'),
(134, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The flaps operate normally.', 'The flaps will not extend.', 'The landing gear retracts normally.', 'The landing extends normally.', 'a'),
(134, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Are held up by a mechanical uplock.', 'Extend normally using the gear handle.', 'Freefall', 'All of the above.', 'c'),
(134, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Both hydraulic systems.', 'Hydraulic system 2 only.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Hydraulic system 1 only.', 'a'),
(134, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '2900 psi.', '3000 psi.', '0 psi.', '1600 psi.', 'c'),
(134, 149, 'mc', 'hydraulics', 'The priority valve in hydraulic system 1 provides:', 'Gives hydraulic system 1 priority over hydraulic system 2.', 'Ensures hydraulic pressure to the landing gear when operating on the electric hydraulic pump.', 'Restricts hydraulic presure from the landing gear to the ensure pressure for the flight controls.', 'All of the above.', 'c'),
(134, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'Ice detectors.', 'TAT probes.', 'The leading edge of the wings and the horizontal stabilizer.', 'A and B are correct.', 'd'),
(134, 169, 'mc', 'ice_rain_prot', 'When taxiing in icing conditions:', 'The engines bleeds must be open for anti-ice.', 'The APU bleed air can be used for air conditioning.', 'The APU bleed cannot be used becuase it is not hot enough for engine anti-ice.', 'All of the above.', 'b'),
(134, 171, 'mc', 'ice_rain_prot', 'Ice test A requires:', 'Override to ALL, test switch for 10 seconds minimum.', 'The override to ENG/test switch held for 20 seconds in each position.', 'Override to AUTO for a minimum of 10 seconds, maximum 30 seconds.', 'Override to AUTO.', 'a'),
(134, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The engine bleeds should be selected open.', 'The engines bleeds will always be closed.', 'The use of packs is only permitted if the APU bleed is available.', 'All of the above.', 'a'),
(134, 158, 'mc', 'ice_rain_prot', 'The SPS/ICE SPEEDS EICAS message is cleared:', 'Once the aircraft exits icing conditions.', 'By pressing the SPS test button at any time.', 'By pressing the quick disconnect button.', 'By pressing the SPS test button (on the ground only).', 'd'),
(134, 182, 'mc', 'ldg_gear_brk', 'The emergency brake provides:', 'Touchdown protection, but not anti-skid protection.', 'Anti-skid protection only.', 'No anti-skid protection.', 'Locked wheel protection, but not touchdown protection.', 'c'),
(134, 179, 'mc', 'ldg_gear_brk', 'The landing gear is normally help up ___ and extended ___.', 'Mechanically, Mechanically.', 'Mechanically, hydrualically.', 'Hydraulically, Mechanically.', 'Hydrualically, hydrualically.', 'b'),
(134, 180, 'tf', 'ldg_gear_brk', 'When using the emergency brakes, the anti-skid, locked wheel and touchdown protection are not available.', 'TRUE', 'FALSE', '', '', 'a'),
(134, 194, 'mc', 'lighting', 'Charging the XR photo luminescent aisle lights is the responsibility of the:', 'Flight crew.', 'Maintenance.', 'Gate agent.', 'All of the above.', 'a'),
(134, 196, 'mc', 'lighting', 'The emergency lights:', 'Automatically come on when normal electrical power is lost.', 'Can only be turned on manual.y by the flight attendant.', 'Drain the main batteries so they should be turned off in an emergency.', 'Recharge when in the OFF position.', 'a'),
(134, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Control column hold firmly.', 'Actuate the pitch trim switch in the opposite direction.', 'Pitch systems 1 & 2 off.', 'All of the above.', 'a'),
(134, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', '100 lbs.', 'No maximum exists provided the roll trim is operative.', '900 lbs.', '800 lbs.', 'd'),
(134, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-65.', '-40.', '20.', '-20.', 'b'),
(134, 215, 'mc', 'limitations', 'What is VLE?', '250 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '200 knots.', '180 knots.', 'a'),
(134, 287, 'mc', 'limitations', 'Can an engine start be allowed to continue if the oil pressure is in the amber range?', 'No - this is an abnormal condition and the start should be aborted regardless of temperature.', 'Yes - if the oil temperature is less than 21 C.', 'Yes - oil pressure limitations only apply during the takeoff phase.', 'None of the above.', 'b'),
(134, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL450.', 'FL350.', 'FL410.', 'FL 370.', 'd'),
(134, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-30 C.', '-52 C.', '-65 C.', '-45 C with momentary deviations to -50 C permitted.', 'd'),
(134, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS below 10,000 feet.', '250 KIAS or MACH .63, whichever is lower.', '250 KIAS or MACH .63, whichever is higher.', '200 KIAS.', 'd'),
(134, 222, 'mc', 'limitations', 'On the takeoff roll, oil pressure reaches 118 PSI. The correct action is to ...', 'Continue takeoff and start your timer.  Youa re time limited to 2 minutes.', 'Disregard - this is a normal oil pressure on takeoff.', 'Abort the takeoff if below V1.', 'All of the above.', 'a'),
(134, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', '200 knots.', '160 knots.', '170 knots.', 'c'),
(134, 230, 'tf', 'oxy', 'When the passenger masks fall, the oxygen flow starts without the passengers taking any action.', 'TRUE', 'FALSE', '', '', 'b'),
(134, 229, 'mc', 'oxy', 'Minimum dispatch pressure for the portable oxygen bottle is:', '1850 PSI.', '1200 PSI.', '500 PSI.', '400 PSI.', 'b'),
(134, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Low power settings.', 'External air starts.', 'Cross-bleed starts.', 'None of the above.', 'b'),
(134, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'During a cross-bleed start.', 'When the override knob on the ice protection panel is in ENG.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'None of the above.', 'a'),
(134, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(134, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 14th stage compressor only.', 'The 9th compressor stage at higher thrust settings.', 'The 14th compressor stage in icing conditions.', 'B and C are correct.', 'd'),
(134, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'All bleeds open, PACKs on, cross bleed open.', 'b'),
(134, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air leaving the pre-cooler is too hot.', 'Air after the compressor is too hot.', 'A massive leak detector has detected a bleed leak.', 'The air leaving the pack is too hot.', 'a'),
(134, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '3 minutes.', '2 minutes.', '1 minute.', '5 minutes.', 'b'),
(134, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD Hydraulic page.', 'EICAS.', 'MFD takeoff page.', 'RMU maintenance page.', 'c'),
(134, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine keeps running but thrust cannot be changed.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine shuts down.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(134, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The engine runs in idle until the pilot resets the FADEC.', 'The other FADEC (same engine) immediately takes over.', 'The engine shuts down.', 'c'),
(134, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '800 C.', '901 C.', '506 C.', '868 C.', 'a'),
(134, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N1 via the tower shaft.', 'N2 via the tower shaft.', 'N2 via a linkage on the HP spool.', 'Reduction gears via the N1 turbine.', 'b'),
(134, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', 'Approximately 30 percent N2.', 'Immediately after IGN is displayed on the EICAS.', '56.4 percent N2.', '12-14 percent N2.', 'a'),
(134, 24, 'ac', 'powerplant', 'The engine has:', 'A 2 stage high-pressure turbine.', '6 stages of CVG vanes.', 'A 14 stage compressor.', 'All of the above.', 'd'),
(134, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'There is no automatic reaction.', 'The thrust reverser stows automatically.', 'The FADEC reduces the thrust to idle automatically.', 'The engine shuts down automatically.', 'c'),
(134, 271, 'mc', 'pressurization', 'The maximum allowed negative cabin differential is ___ PSID:', '7.8', '7.5', '8.1', '-0.3', 'd'),
(134, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Landing elevation.', 'Takeoff elevation.', 'Desired cabin altitude.', 'Cruise altitude.', 'a'),
(134, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '24,600''.', '14,000'' +/- 500''.', '1700'' AGL.', '25,000''.', 'd'),
(134, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Above a safe altitude.', 'Positive rate of climb.', 'Reaching acceleration height and then a speed of V2 + 15.', 'None of the above.', 'c'),
(134, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'GMAP mode is only available during ground operations.', 'The radar cannot be used on the ground.', 'Increasing gain increases the energy output from the antenna.', 'Increasing gain increases receiver sensitivity.', 'd'),
(134, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If the SPS/ICE SPEEDs message is displayed.', 'If the airspeed is less than 200 kts.', 'If one channel of the SPS is inoperative.', 'None of the above.', 'c'),
(134, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'At 130 KIAS.', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'B and C are correct.', 'd'),
(134, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'LAV SMOKE', 'BAGG SMOKE', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'b'),
(134, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'b'),
(134, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'c'),
(134, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'None of the above.', 'b'),
(134, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, twist to Emergency.', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'd'),
(135, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs stay on.', 'Only pack 1 turns off.', 'Only pack 2 turns off.', 'Both packs turn off.', 'd'),
(135, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd'),
(135, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Under cockpit access hatch.', 'Baggage compartment door.', 'Forward nose hydraulic compartment.', 'Overwing emergency exit.', 'a'),
(135, 34, 'mc', 'apu', 'The proper way to shut down the APU is to:', 'Press the stop button, wait until 0% rotation, then turn the master knob to OFF.', 'Close the APU bleed valves, wait 3 minutes, press the stop button, then turn the master knob to OFF.', 'Press the FUEL SHUTOFF button.', 'None of the above.', 'a'),
(135, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '-20 C', '54 C', '40 C', '70 C', 'a'),
(135, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Flight Director button on the Flight Guidance Control Panel', 'Flight Mode Anunciator (FMA).', 'Flight Guidance Controller', 'Display Control Panel', 'b'),
(135, 40, 'mc', 'autopilot', 'After having been cleared for the approach, the approach mode can be activated within ___ degrees for a front course approach.', '45', '100', '90', '70', 'c'),
(135, 50, 'mc', 'autopilot', 'On non-XR aircraft above 12,000 in FLC, the aircraft climbs at...', '270 KIAS until MACH 0.56', '290 KIAS until MACH 0.56', '2000 fpm', '270 KIAS until MACH 0.65', 'a'),
(135, 54, 'mc', 'autopilot', 'The FMA displays what messages after pressing the TOGA buttons on the ground?', 'ROL/TO', 'HDG/TO', 'ROL/GA', 'ROL/VS', 'a'),
(135, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'NAV', 'HDG', 'FMS', 'All of the above.', 'a'),
(135, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(135, 85, 'mc', 'crew_awareness', 'What does it look like on the 5 cockpit screens when you lose DC Bus 2?', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'c'),
(135, 61, 'mc', 'crew_awareness', 'The flight data recorder is activated (starts recording):', 'By turning on the NAV lights.', 'By a 5G impact or immersion in water.', 'By turning on the red beacon', 'None of the above.', 'c'),
(135, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'It doesn''t appear anywhere immediately.', 'MFD 1.', 'TBCH.', 'RMU 1.', 'a'),
(135, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'Amber HDG flag above HSI.', 'ATT FAIL, HDG FAIL on PFD.', 'SG 2', 'MAG 2, ATT 2.', 'b'),
(135, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'DAU2B has failed.', 'Only one aural channel is working.', 'The digital audio panel is inoperative.', 'Both aural channels have failed.', 'd'),
(135, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By a 5G impact or immersion in water.', 'By turning on the navigation lights.', 'As soon as the electrical system is powered.', 'None of the above.', 'c'),
(135, 64, 'mc', 'crew_awareness', 'How many transponders are on the aircraft?', '2', '1', '3', 'All of the above.', 'a'),
(135, 63, 'tf', 'crew_awareness', 'COM 3 cannot be used for voice communication when the EMER button is pushed in (selected) on the digital audio panel.', 'TRUE', 'FALSE', '', '', 'a'),
(135, 4, 'mc', 'crew_awareness', 'Which event is specific to a symbol generator 1 failure?', 'Symbol generator 2 automatically supplies symbols to all 5 screens.', 'RMU 1 automatically displays Engine Page 1', 'PFD1 and MFD1 go blank.', 'The EICAS reversionary buttons must be pressed to activate channel B.', 'b'),
(135, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '25 minutes.', '15 minutes.', '20 minutes.', '40 minutes.', 'd'),
(135, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and FADECs.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'All of the above.', 'a'),
(135, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'Weather Radar.', 'EGPWS/Wind Shear.', 'A and C are correct.', 'd'),
(135, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Four, 24 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Four, 28 Volt DC generators.', 'Five, 24 Volt DC generators.', 'b'),
