(138, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '250 knots.', '240 knots.', '200 knots.', '180 knots.', 'c'),
(138, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'No.', 'Only if the crossfeed is on.', 'Yes, provided the flight crew advises ATC.', 'a'),
(138, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Actuate the pitch trim switch in the opposite direction.', 'Control column hold firmly.', 'Pitch systems 1 & 2 off.', 'Quick disconnect button, press and hold.', 'b'),
(138, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS below 10,000 feet.', '250 KIAS or MACH .63, whichever is higher.', '250 KIAS or MACH .63, whichever is lower.', '200 KIAS.', 'd'),
(138, 207, 'mc', 'limitations', 'While descending through 10,000 ft, you notice the LP spool vibration on engine 1 is in the amber.  How long may it remain in the Amber?', '90 seconds', '5 minutes.', '10 seconds.', '1 minute.', 'c'),
(138, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL300.', 'FL370.', 'FL200.', 'FL350.', 'a'),
(138, 232, 'mc', 'oxy', 'Placing the passenger oxygen knob to ON will deploy the oxygen masks:', 'When cabin altitude exceeds 14,000 feet.', 'Anytime power is supplied.', 'Only in flight.', 'All of the above.', 'b'),
(138, 225, 'mc', 'oxy', 'The FASTEN SEAT BELT signs are automatically turned on:', 'In essential power.', 'Upon pressing the CONFIRM INIT button on the FMS prior to pushback.', 'Never.', 'When the oxygen ON indicator light is illuminated.', 'd'),
(138, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, closed.', 'OPEN, open.', 'AUTO, open.', 'None of the above.', 'a'),
(138, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'The air leaving the pack is too hot.', 'Air leaving the pre-cooler is too hot.', 'A massive leak detector has detected a bleed leak.', 'Air after the compressor is too hot.', 'b'),
(138, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 14th stage compressor only.', 'The 9th compressor stage at higher thrust settings.', 'The 14th compressor stage in icing conditions.', 'B and C are correct.', 'd'),
(138, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'The engine bleed valve closes.', 'The APU bleed valve closes.', 'Both valves can be open at the same time.', 'c'),
(138, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'a'),
(138, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'Open inscription, no line.', 'No line, no open inscription.', 'A line, no OPEN inscription.', 'd'),
(138, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine keeps running but thrust cannot be changed.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine shuts down.', 'All of the above.', 'c'),
(138, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'Reduction gears via the N1 turbine.', 'N2 via a linkage on the HP spool.', 'N2 via the tower shaft.', 'None of the above.', 'c'),
(138, 255, 'mc', 'powerplant', 'The A1/E engines are limited to ___ ITT.', '901 continuous.', '880 for starting.', '948 C.', '992 C for 90 seconds and up to 970 C for 5 minutes.', 'd'),
(138, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Shut the engine down immediately and call maintenance.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'd'),
(138, 254, 'tf', 'powerplant', 'Do not abort the takeoff if oil pressure increases from the green to the amber range:', 'TRUE', 'FALSE', '', '', 'a'),
(138, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The essential buses.', 'The PMA only.', 'The essential buses or the PMA depending on N2 RPM.', 'The essential buses during an electrical emergency.', 'c'),
(138, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'ALT TO TO, TO RSV, ETO RSV.', 'TO, ETO, TO RSV.', 'ALT TO, TO, ETO.', 'ETO, TO RSV, ETO RSV.', 'c'),
(138, 24, 'ac', 'powerplant', 'The engine has:', '6 stages of CVG vanes.', 'A 2 stage high-pressure turbine.', 'A 14 stage compressor.', 'All of the above.', 'd'),
(138, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD Hydraulic page.', 'EICAS.', 'RMU maintenance page.', 'MFD takeoff page.', 'd'),
(138, 271, 'mc', 'pressurization', 'The maximum allowed negative cabin differential is ___ PSID:', '-0.3', '8.1', '7.5', '7.8', 'a'),
(138, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '14,000'' +/- 500''.', '24,600''.', '25,000''.', '1700'' AGL.', 'c'),
(138, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the CPAM.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'All of the above.', 'a'),
(138, 276, 'mc', 'profiles', 'During takeoff, if an engine fire is indicated after V1:', 'The takeoff should be aborted if sufficient runway remains.', 'Continue the takeoff and perform the engine fire QRH after reaching V2.', 'Continue the takeoff and perform the engine fire QRH after reaching a safe altitude.', 'All of the above.', 'c'),
(138, 288, 'mc', 'radar', 'Which mode of the radar can be used to depict potential radar ''shadows''?', 'STAB', 'TGT', 'DG', 'RCT', 'd'),
(138, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Red.', 'White', 'Amber.', 'All of the above.', 'a'),
(138, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'c'),
(138, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'All of the above.', 'b'),
(138, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, twist to Emergency.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'The crew must ensure that no passengers are on board.', 'c'),
(138, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'b'),
(138, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'E1(2) EXTBL A(B) INOP', 'LAV SMOKE', 'APU Fire Loop Fail', 'BAGG SMOKE', 'd'),
(138, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'c'),
(139, 25, 'mc', 'air_condition', 'At 2000 AGL in CLB thrust mode, icing conditions, both packs selected ON:', 'Both packs are off.', 'Pack 1 is on, 2 is off.', 'Pack 2 is on, 1 is off.', 'Both packs are on.', 'c');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(139, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Only pack 1 turns off.', 'Only pack 2 turns off.', 'Both packs stay on.', 'a'),
(139, 30, 'mc', 'acft_gen', 'An EMB-145 XR is approximately...', '98 feet in length.', '110 feet in length.', '89 feet in length.', '160 % of the length of an EMB-135.', 'a'),
(139, 35, 'mc', 'apu', 'The APU''s logic commands an automatic shutdown for which of the following conditions in flight?', 'High oil temperature.', 'Overtemperature.', 'Fire.', 'Overspeed.', 'd'),
(139, 12, 'mc', 'apu', 'The maximum load on the APU generator above FL300 is:', '400 Amps.', '300 Amps.', '200 Amps.', '500 Amps.', 'b'),
(139, 45, 'mc', 'autopilot', 'When low bank is NOT selected, what is the maximum bank the autopilot will use for any lateral mode?', '10 degrees.', '27 degrees.', '14 degrees.', '13 degrees.', 'b'),
(139, 50, 'mc', 'autopilot', 'On LR aircraft above 12,000 in FLC, the aircraft climbs at...', '290 KIAS until MACH 0.56', '2000 fpm', '270 KIAS until MACH 0.65', '270 KIAS until MACH 0.56', 'd'),
(139, 41, 'mc', 'autopilot', 'During descent, FLC works just like:', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'SPD mode but with preset speeds.', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'VS mode but with preset vertical speeds', 'd'),
(139, 48, 'mc', 'autopilot', 'What pitch attitude does the aircraft hold in the go-around sub-mode for the first twenty seconds (airspeed > 1.23VS)?', '14 degrees (once you are flaps 9).', '13 Degrees.', 'The aircraft does not hold a specific pitch attitude during the first 20 seconds of this sub-mode.', '10 Degrees', 'd'),
(139, 40, 'mc', 'autopilot', 'After having been cleared for the approach, the approach mode can be activated within ___ degrees for a front course approach.', '90', '70', '45', '100', 'a'),
(139, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'ATT FAIL appears on the EADI on the PFD.', 'Airspeed will be covered with hash marks', 'The cross-side AHRS automatically takes over.', 'b'),
(139, 4, 'mc', 'crew_awareness', 'If symbol generator 1 fails:', 'Symbol generator 2 automatically supplies symbols to all 5 screens.', 'RMU 1 automatically displays Engine Page 1', 'The EICAS reversionary buttons must be pressed to activate channel B.', 'PFD1 and MFD1 go blank.', 'b'),
(139, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(139, 60, 'mc', 'crew_awareness', 'The emergency button on the digital audio panel:', 'Commands the TBCH to operate in the emergency mode.', 'Automatically switches to VHF 1 to 121.50.', 'Connect the captain only to COM 1 and NAV 1 and FO to COM 2 and NAV 2.', 'Illuminates the EMER button on the flight attendant interphone.', 'c'),
(139, 85, 'mc', 'crew_awareness', 'How do the 5 cockpit CRTs appear following the loss of DC Bus 2?', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'a'),
(139, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Is automatically displayed on RMU 1', 'Is powered normally.', 'Can be presented by using MFD reversion.', 'All of the above.', 'b'),
(139, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The standby airspeed indicator becomes unreliable.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'A and C are correct.', 'd'),
(139, 81, 'mc', 'crew_awareness', 'The power source for SG 2 is:', 'DC bus 1', 'Essential bus 1', 'DC Bus 2', 'None of the above.', 'c'),
(139, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By turning on the red beacon.', 'By a 5G impact or immersion in water.', 'By turning on the navigation lights.', 'As soon as the electrical system is powered.', 'd'),
(139, 3, 'mc', 'crew_awareness', 'Which one of these will NOT give you a takeoff configuration warning?', 'One or both engines not running.', 'Pitch trim set to 0 degrees.', 'Flaps 0.', 'Parking brake set.', 'a'),
(139, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and FADECs.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'b'),
(139, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Roll trim.', 'Normal gear extension.', 'Pressurization.', 'All of the above.', 'b'),
(139, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'DC bus 1 and DC bus 2', 'The hot battery busses, essential busses, and the central DC bus.', 'All electrical busses except the shed busses.', 'All of the above.', 'b'),
(139, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'Weather Radar.', 'EGPWS/Wind Shear.', 'A and C are correct.', 'd'),
(139, 90, 'tf', 'elec', 'The ground service bus is not powered when the GPU is selected.', 'TRUE', 'FALSE', '', '', 'a'),
(139, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS1, DAU1B, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS, PFD and MFDs.', 'SG2, DAU2B', 'b'),
(139, 76, 'mc', 'elec', 'The ELT battery:', 'Is charged by the shed buses', 'Is charged only when the ELT switch is in the ARM position.', 'Is charged by the esential busses', 'Is not charged.', 'd'),
(139, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The ground air supply is supplying bleed air to the packs.', 'The aircraft electrical system is powered.', 'The ground power unit is disconnected from the aircraft.', 'That the GPU is plugged in with some power available.', 'd'),
(139, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Opens the BBC, isolating the backup battery hot bus.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Removes power from the backup flight instruments.', 'Allows a test of the ISIS on LR aircraft.', 'a'),
(139, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a'),
(139, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', 'b'),
(139, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'c'),
(139, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Shuts off all hydraulic pressure on the associated side.', 'Closes the associated hydraulic shutoff valve.', 'All of the above.', 'c'),
(139, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The flight attendant hears a warning horn.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The LAV SMOKE EICAS warning appears.', 'None of the above.', 'd'),
(139, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'APU fire detection and protection is available in essential power.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'All of the above.', 'd'),
(139, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '1', '3', '0', 'None of the above.', 'b'),
(139, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The rudder is in manual reversion.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'The deflection is 5 degrees +/- 1 degree.', 'a'),
(139, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '9 Degrees.', '22 Degrees.', '18 Degrees.', 'A and C are correct.', 'd'),
(139, 116, 'mc', 'flt_control', 'In essential power, the flaps:', 'Will not operate.', 'Are operative under manual reversion.', 'Operate normally.', 'Will operate at half speed.', 'a'),
(139, 127, 'mc', 'flt_control', 'Ailerons are positioned utilizing:', 'Offside hydraulic pressure only.', 'Onside hydraulic pressure only.', 'Mechanical Means.', 'Both hydraulic systems.', 'd'),
(139, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '22 Degrees.', '45 Degrees.', '18 Degrees.', 'A and B are correct.', 'd'),
(139, 137, 'tf', 'fuel', 'The ventral tank fuel transfer can take place while crossfeeding.', 'TRUE', 'FALSE', '', '', 'b'),
(139, 138, 'mc', 'fuel', 'If the fuel boost pump fails:', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will continue to run by suction feed through a check valve.', 'The engine will eventually flame out due to lack of fuel.', 'None of the above.', 'a'),
(139, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'a'),
(139, 140, 'mc', 'fuel', 'In essential power:', 'Only the A and B fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'All fuel boost pumps are available.', 'None of the above.', 'a'),
(139, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'One wing tank reaches 1863 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'd'),
(139, 155, 'mc', 'hydraulics', 'In essential power, the electric hydraulic pumps are:', 'Not available.', 'Only the #2 pump is available for the emergency brakes.', 'Both available.', 'Only the #1 pump is available for landing gear extension.', 'a'),
(139, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '0 psi.', '3000 psi.', '1600 psi.', '2900 psi.', 'a'),
(139, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Ailerons and rudder should all pressure be lost.', 'Nosewheel steering.', 'Emergency brakes.', 'None of the above.', 'd'),
(139, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Outboard spoilers, inboard brakes, emergency brakes.', 'Inboard spoilers, outboard brakes, landing gear.', 'Emergency brakes only, supplying 6 applications.', 'Emergency brakes only, unlimited applications.', 'c'),
(139, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'Places the electric hydraulic pump in a standby condition.', 'Turns on the electric pump only if the engine is shut down.', 'Turns on the electric pump regardless of system pressure.', 'd'),
(139, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is on and cannot be turned off.', 'Is not available.', 'Is available with the override switch in ALL.', 'c'),
(139, 171, 'mc', 'ice_rain_prot', 'Ice test A requires:', 'Override to AUTO.', 'Override to AUTO for a minimum of 10 seconds, maximum 30 seconds.', 'Override to ALL, test switch for 10 seconds minimum.', 'The override to ENG/test switch held for 20 seconds in each position.', 'c'),
(139, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'DC Bus 1.', 'The essential buses.', 'The shed bus.', 'All of the above.', 'b'),
(139, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'Comes from the 9th stage of the compressor only.', 'Not available.', 'On and cannot be turned off.', 'None of the above.', 'c'),
(139, 159, 'mc', 'ice_rain_prot', 'When is the ice protection penalty on the runway analysis required?', 'Visibility 1 & 1/2 SM and 15 degrees Celsius.', '1000'' overcast and 12 degrees Celsius.', 'Clear skies and 2 degrees Celsius.', 'Rain and 20 degrees Celsius.', 'b'),
(139, 176, 'mc', 'ldg_gear_brk', 'The emergency brake lines supply:', 'All 4 brakes.', 'The inboard brakes only.', 'All 6 brakes.', 'The outboard brakes only.', 'a'),
(139, 191, 'mc', 'ldg_gear_brk', 'In essential power, how should the landing gear be extended?', 'By normal means.', 'Electrical override.', 'Through use of hydraulic accumulator 2.', 'Free-fall lever.', 'a'),
(139, 182, 'mc', 'ldg_gear_brk', 'The emergency brake provides:', 'Touchdown protection, but not anti-skid protection.', 'No anti-skid protection.', 'Anti-skid protection only.', 'All of the above.', 'b'),
(139, 195, 'tf', 'lighting', 'The nose landing and taxi lights are only illuminated if the respective light switches are on and the gear is down and locked.', 'TRUE', 'FALSE', '', '', 'a'),
(139, 197, 'mc', 'lighting', 'The emergency lights will last a minimum of:', '30 minutes.', '15 minutes.', '45 minutes if pitot 3 heat is turned off.', '40 minutes.', 'b'),
(139, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-40 F.', '-40 C.', '-20 C.', '-20 F.', 'b'),
(139, 215, 'mc', 'limitations', 'What is VLE?', '250 knots.', '180 knots.', '200 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', 'a'),
(139, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Only if the crossfeed is on.', 'Yes.', 'Yes, provided the flight crew advises ATC.', 'None of the above.', 'b'),
(139, 121, 'mc', 'limitations', 'The maximum airspeed with flaps 18 is:', '200 KIAS.', '140 KIAS.', '250 KIAS.', '160 KIAS.', 'a'),
(139, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 15 C.', 'ISA + 25 C.', 'ISA + 35 C.', 'ISA + 45 C.', 'c'),
(139, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-45 C with momentary deviations to -50 C permitted.', '-65 C.', '-52 C.', '-30 C.', 'a'),
(139, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL410.', 'FL450.', 'FL350.', 'FL 370.', 'd'),
(139, 213, 'mc', 'limitations', 'The maximum static air temperature (SAT) at FL370 is ___.', '-65 C.', '-21.5 C.', '9 C.', '35 C.', 'b'),
(139, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-65.', '-40.', '-20.', '20.', 'b'),
(139, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Actuate the pitch trim switch in the opposite direction.', 'Pitch systems 1 & 2 off.', 'Control column hold firmly.', 'All of the above.', 'c'),
(139, 226, 'mc', 'oxy', 'With the passenger oxygen knob in AUTO (non-XR) the passenger oxygen masks drop at:', '14,000'' cabin altitude.', '14,000'' MSL.', '9,900 +/- 100'' cabin altitude.', '14,000'' AGL.', 'a'),
(139, 235, 'mc', 'oxy', 'To ensure adequate oxygen for dispatch, one must know the number of crew, oxygen pressure and:', 'Outisde air temperature.', 'Actual ramp temperature.', 'Cockpit temperature.', 'Current ATIS temperature.', 'c'),
(139, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, closed.', 'AUTO, open.', 'CLOSED, closed.', 'OPEN, open.', 'a'),
(139, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line, no OPEN inscription.', 'A line and an OPEN inscription.', 'No line, no open inscription.', 'Open inscription, no line.', 'a'),
(139, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(139, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'The engine bleed valve should automatically close.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'All of the above.', 'd'),
(139, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th compressor stage in icing conditions.', 'The 14th stage compressor only.', 'A and B are correct.', 'd'),
(139, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Ice test A.', 'Low power settings.', 'Cross-bleed starts.', 'External air starts.', 'd'),
(139, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The other FADEC (same engine) immediately takes over.', 'The engine shuts down.', 'The engine runs in idle until the pilot resets the FADEC.', 'None of the above.', 'a'),
