(145, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air after the compressor is too hot.', 'Air leaving the pre-cooler is too hot.', 'The air leaving the pack is too hot.', 'A massive leak detector has detected a bleed leak.', 'b'),
(145, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'Both valves can be open at the same time.', 'The APU bleed valve closes.', 'All of the above.', 'c'),
(145, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'Open inscription, no line.', 'A line, no OPEN inscription.', 'No line, no open inscription.', 'A line and an OPEN inscription.', 'b'),
(145, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Ice test A.', 'Low power settings.', 'External air starts.', 'Cross-bleed starts.', 'c'),
(145, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'CLOSED, closed.', 'OPEN, open.', 'AUTO, closed.', 'AUTO, open.', 'c'),
(145, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine shuts down.', 'The engine keeps running but thrust cannot be changed.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine keeps running in N1 reversionary mode.', 'a'),
(145, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N1 via the tower shaft.', 'N2 via the tower shaft.', 'Reduction gears via the N1 turbine.', 'N2 via a linkage on the HP spool.', 'b'),
(145, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '5 minutes.', '2 minutes.', '1 minute.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(145, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', '9th stage bleed air.', 'Engine oil pressure.', 'PMA.', 'Fuel pressure.', 'd'),
(145, 24, 'ac', 'powerplant', 'The engine has:', 'A 14 stage compressor.', '6 stages of CVG vanes.', 'A 2 stage high-pressure turbine.', 'All of the above.', 'd'),
(145, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The other FADEC (same engine) immediately takes over.', 'The engine shuts down.', 'The engine runs in idle until the pilot resets the FADEC.', 'The engine shuts down and may be restarted after alternating FADECs.', 'a'),
(145, 265, 'mc', 'powerplant', 'Which is not an item in the engine''s accessory gear box?', 'Engine driven generator.', 'Hydraulic pump.', 'Ejector pump.', 'Oil pump.', 'c'),
(145, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'TO, ETO, TO RSV.', 'ALT TO TO, TO RSV, ETO RSV.', 'ALT TO, TO, ETO.', 'ETO, TO RSV, ETO RSV.', 'c'),
(145, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'The FADEC reduces the thrust to idle automatically.', 'The thrust reverser stows automatically.', 'The engine shuts down automatically.', 'There is no automatic reaction.', 'a'),
(145, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Provide static information to the CPAM.', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the ADCs.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'b'),
(145, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Static ports 2 and 3.', 'Static ports 1 and 4.', 'Pitot/static tube 3.', 'The static/pressurization ports.', 'c'),
(145, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'Immediately after the PACKs are selected during the after takeoff flow.', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'c'),
(145, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Positive rate of climb.', 'Vfs.', 'Reaching acceleration height and then a speed of V2 + 15.', 'None of the above.', 'c'),
(145, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'Increasing gain increases the energy output from the antenna.', 'GMAP mode is only available during ground operations.', 'The radar cannot be used on the ground.', 'Increasing gain increases receiver sensitivity.', 'd'),
(145, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'All of the above.', 'b'),
(145, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If the SPS/ICE SPEEDs message is displayed.', 'If one channel of the SPS is inoperative.', 'If the airspeed is less than 200 kts.', 'All of the above.', 'b'),
(145, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'E1(2) EXTBL A(B) INOP', 'APU Fire Loop Fail', 'BAGG SMOKE', 'All of the above.', 'c'),
(145, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, twist to Emergency.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'All of the above.', 'c'),
(145, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine thrust must be at a minimum of 83% N1.', 'All three bleed valves must be closed.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'd'),
(145, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'b'),
(145, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'd'),
(146, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the compressor is too hot.', 'The air leaving the pack is too hot.', 'The air entering the compressor is too hot.', 'The air entering the pack is too hot.', 'b'),
(146, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Pack 2 is on, 1 is off.', 'Both packs are on.', 'Pack 1 is on, 2 is off.', 'Both packs are off.', 'a'),
(146, 12, 'mc', 'apu', 'The maximum load on the APU generator above FL300 is:', '400 Amps.', '500 Amps.', '200 Amps.', '300 Amps.', 'd'),
(146, 17, 'c2', 'apu', 'The APU can be started using:', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'Battery 1.', 'A and B are correct.', 'd'),
(146, 36, 'mc', 'autopilot', 'At what altitude must the autopilot be disengaged on a CAT I ILS approach?', '500'' AGL.', '1000'' AGL.', '1500'' AGL.', '200'' AGL.', 'd'),
(146, 37, 'mc', 'autopilot', 'What is the minimum engagement height for the autopilot (feet)?', '500', '200', '800', '1000', 'a'),
(146, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Can be presented by using SG reversion.', 'Can be presented by using MFD reversion.', 'Is powered normally.', 'All of the above.', 'c'),
(146, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'Only one aural channel is working.', 'The digital audio panel is inoperative.', 'Both aural channels have failed.', 'DAU2B has failed.', 'c'),
(146, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You have one electrical system despite having 4 or more generators on-line.', 'You are not in the essential power configuration but should be.', 'You are in essential power configuration but should not be.', 'None of the above.', 'b'),
(146, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a'),
(146, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'EGPWS/Wind Shear.', 'Weather Radar.', 'A and B are correct.', 'd'),
(146, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The GCUs, EDL and FADECs.', 'b'),
(146, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'b'),
(146, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The engine bleed and lip anti-ice ice valves.', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'All of the above.', 'd'),
(146, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '3', '2', '0', '1', 'a'),
(146, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '9 Degrees.', '22 Degrees.', '18 Degrees.', 'A and C are correct.', 'd'),
(146, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The deflection is 5 degrees +/- 1 degree.', 'The rudder is in manual reversion.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'd'),
(146, 141, 'tf', 'fuel', 'The fuel crossfeed valve automatically closes in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(146, 140, 'mc', 'fuel', 'In essential power:', 'Only the C fuel boost pumps are available.', 'No fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'All of the above.', 'c'),
(146, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '1600 psi.', '3000 psi.', '1200 psi.', '2900 psi.', 'b'),
(146, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Both hydraulic systems.', 'Hydraulic system 1 only.', 'Hydraulic system 2 only, when above 135 KIAS.', 'None of the above.', 'a'),
(146, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'On and cannot be turned off.', 'Not available.', 'Available if selected on or in icing conditions.', 'Comes from the 9th stage of the compressor only.', 'a'),
(146, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'No ice test is needed.', 'There are clear ice-detectors on the wings.', 'The vertical stabilizer is heated.', 'The XR has boots.', 'b'),
(146, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The engines bleeds will always be closed.', 'The engine bleeds should be selected open.', 'Pack 1 is off, Pack 2 is on.', 'The use of packs is only permitted if the APU bleed is available.', 'b'),
(146, 164, 'mc', 'ice_rain_prot', 'For ice protection to be activated automatically:', 'One or both ice detectos must be detecting ice.', 'The TAT must be less than 0 C.', 'The TAT must be less than 10 C.', 'Both ice detectors must be working and detecting ice.', 'a'),
(146, 14, 'c2', 'ldg_gear_brk', 'With a total loss of hydraulic system #1, the landing gear:', 'Must be extended with the freefall actuator.', 'Cannot be retracted once extended.', 'Operates using hydraulic system #2 pressure, but may be slower due to the priority valve', 'A and B are correct.', 'd'),
(146, 178, 'c2', 'ldg_gear_brk', 'If down to hydraulic accumulator 2 only, the aircraft has:', 'Unlimited emergency brake applications.', 'At least 6 emergency brake applications.', 'Parking brake pressure for 24 hours.', 'B and C are correct.', 'd'),
(146, 196, 'mc', 'lighting', 'The emergency lights:', 'Recharge when in the OFF position.', 'Drain the main batteries so they should be turned off in an emergency.', 'Automatically come on when normal electrical power is lost.', 'Can only be turned on manual.y by the flight attendant.', 'c'),
(146, 200, 'mc', 'lighting', 'The emergency light batteries are charged with normal power established on the aircraft and when the emergency light switch is in the:', 'ON position.', 'OFF position.', 'Are not charged and replaced periodically by maintenance.', 'ARM position.', 'd'),
(146, 215, 'mc', 'limitations', 'What is VLE?', '250 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '180 knots.', '200 knots.', 'a'),
(146, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL200.', 'FL370.', 'FL300.', 'FL350.', 'c'),
(146, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', '160 knots.', '170 knots.', '200 knots.', 'b'),
(146, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', '900 lbs.', '100 lbs.', '800 lbs.', 'No maximum exists provided the roll trim is operative.', 'c'),
(146, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '250 amps.', '300 amps.', '400 amps.', '350 amps.', 'b'),
(146, 225, 'mc', 'oxy', 'The FASTEN SEAT BELT signs are automatically turned on:', 'When the oxygen ON indicator light is illuminated.', 'Never.', 'In essential power.', 'Upon pressing the CONFIRM INIT button on the FMS prior to pushback.', 'a'),
(146, 229, 'mc', 'oxy', 'Minimum dispatch pressure for the portable oxygen bottle is:', '1850 PSI.', '500 PSI.', '400 PSI.', '1200 PSI.', 'd'),
(146, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd'),
(146, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'CLOSED, closed.', 'OPEN, open.', 'AUTO, closed.', 'AUTO, open.', 'c'),
(146, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'No line, no open inscription.', 'Open inscription, no line.', 'A line and an OPEN inscription.', 'A line, no OPEN inscription.', 'd'),
(146, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'The engine bleed valve should automatically close.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'All of the above.', 'd'),
(146, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The essential buses or the PMA depending on N2 RPM.', 'The essential buses.', 'The PMA only.', 'None of the above.', 'a'),
(146, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', 'Immediately after IGN is displayed on the EICAS.', 'Approximately 30 percent N2.', '56.4 percent N2.', '12-14 percent N2.', 'b'),
(146, 254, 'tf', 'powerplant', 'During the takeoff, oil pressure rises to 117 PSI.  The takeoff should not be aborted.', 'TRUE', 'FALSE', '', '', 'a'),
(146, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Limits N1 to 106%.', 'Presents the FADEC NO DISP EICAS.', 'Automatically shuts down the engine.', 'Fails and the other FADEC takes over.', 'c'),
(146, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Will depressurize up to FL370.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'A and C are correct.', 'd'),
(146, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Static ports 1 and 4.', 'The static/pressurization ports.', 'Static ports 2 and 3.', 'Pitot/static tube 3.', 'd'),
(146, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If the SPS/ICE SPEEDs message is displayed.', 'If the airspeed is less than 200 kts.', 'During an SPS test.', 'If one channel of the SPS is inoperative.', 'd'),
(146, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'All of the above.', 'b'),
(146, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine thrust must be at a minimum of 83% N1.', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'd'),
(146, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, twist to Emergency.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'd'),
(147, 25, 'mc', 'air_condition', 'At 2000 AGL in CLB thrust mode, icing conditions, both packs selected ON:', 'Both packs are off.', 'Pack 2 is on, 1 is off.', 'Both packs are on.', 'Pack 1 is on, 2 is off.', 'b'),
(147, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs stay on.', 'Only pack 1 turns off.', 'Both packs turn off.', 'None of the above.', 'c'),
(147, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Baggage compartment door.', 'Under cockpit access hatch.', 'Forward nose hydraulic compartment.', 'Overwing emergency exit.', 'b'),
(147, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '20.0V', '19.0V', '23.5V', '24.0V', 'b'),
(147, 17, 'c2', 'apu', 'The APU can be started using:', 'Battery 1.', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'B and C are correct.', 'd'),
(147, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The "AP" button on the Flight Guidance Control Panel', 'The quick disconnect button', 'Use of pitch trim', 'All of the above.', 'd'),
(147, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Flight Guidance Controller', 'Flight Mode Anunciator (FMA).', 'Flight Director button on the Flight Guidance Control Panel', 'All of the above.', 'b'),
(147, 40, 'mc', 'autopilot', 'After having been cleared for the approach, the approach mode can be activated within ___ degrees for a front course approach.', '70', '100', '45', '90', 'd'),
(147, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'FMS', 'NAV', 'HDG', 'HDG, then FMS.', 'b'),
(147, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 18).', 'A and B are correct.', 'd'),
(147, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Is powered normally.', 'Is automatically displayed on RMU 1', 'Can be presented by using SG reversion.', 'Can be presented by using MFD reversion.', 'a'),
(147, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'Both aural channels have failed.', 'The digital audio panel is inoperative.', 'DAU2B has failed.', 'Only one aural channel is working.', 'a'),
(147, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'A difference of 6 degrees between the left and right AHRS headings.', 'Check your heading, you''re drifting from the assigned heading.', 'The heading system has failed.', 'All of the above.', 'a'),
(147, 85, 'mc', 'crew_awareness', 'What does it look like on the 5 cockpit screens when you lose DC Bus 2?', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'PFD 2 and MFD 2 are blank.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'd'),
(147, 61, 'mc', 'crew_awareness', 'The flight data recorder is activated (starts recording):', 'By turning on the NAV lights.', 'By a 5G impact or immersion in water.', 'As soon as the electrical system is powered.', 'By turning on the red beacon', 'd'),
(147, 60, 'mc', 'crew_awareness', 'The emergency button on the digital audio panel:', 'Illuminates the EMER button on the flight attendant interphone.', 'Automatically switches to VHF 1 to 121.50.', 'Connect the captain only to COM 1 and NAV 1 and FO to COM 2 and NAV 2.', 'Commands the TBCH to operate in the emergency mode.', 'c'),
(147, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'A disagreement between IC-600''s on EICAS messages displayed.', 'Altitude displayed on each PFD differs by more than 200 feet.', 'SG reversion has been selected.', 'All of the above.', 'a'),
(147, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'DAU 1B automatically takes over.', 'Engine #1 indications are replaced with amber dashes', 'Aft aircraft systems information is unavailable.', 'The FADEC syncs N2 to N1.', 'b'),
(147, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'MFD 1.', 'TBCH.', 'It doesn''t appear anywhere immediately.', 'RMU 1.', 'c'),
(147, 3, 'mc', 'crew_awareness', 'Which parameter is not evaluated for a takeoff configuration check?', 'Pitch trim set to 0 degrees.', 'Parking brake set.', 'Flaps 0.', 'One or both engines not running.', 'd'),
(147, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b'),
(147, 76, 'mc', 'elec', 'The ELT battery:', 'Is charged by the esential busses', 'Is not charged.', 'Is charged by the shed buses', 'Is charged only when the ELT switch is in the ARM position.', 'b'),
(147, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'VOR-DME approaches can be flown using the standby instruments.', 'All of the above.', 'a'),
(147, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'A and B are correct.', 'd'),
(147, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Normal gear extension.', 'Flaps.', 'Pressurization.', 'Roll trim.', 'a'),
(147, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered except the shed buses.', 'All DC buses are powered.', 'Only the esential buses can be powered.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'a'),
(147, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS, PFD and MFDs.', 'SG2, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS1, DAU1B, DAU2B', 'c'),
(147, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and FADECs.', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'c'),
(147, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'Backup hot bus.', 'DC bus 2.', 'Essential bus 2.', 'Central DC bus.', 'a'),
(147, 90, 'tf', 'elec', 'The ground service bus is only powered with an available GPU NOT selected and the batteries OFF.', 'TRUE', 'FALSE', '', '', 'a'),
(147, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'a'),
(147, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'd'),
(147, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '0', '3', '2', '1', 'b'),
(147, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV BOTTLE INOP EICAS warning appears.', 'The LAV SMOKE EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd'),
(147, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', '1 Halon fire bottle for the lavatory waste basket', 'A and C are correct.', 'd'),
(147, 107, 'tf', 'fire_prot', 'APU fire detection and protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'b'),
(147, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'A low TLA (thrust lever angle).', 'The flap lever has to be at 0 or 9 degrees.', 'The speedbrake lever has to be selected to OPEN.', 'All of the above.', 'd'),
